-- Table structure for `t_product`
-- ----------------------------
DROP TABLE IF EXISTS `t_product`;
CREATE TABLE `t_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(45) NOT NULL,
  `introduce` varchar(500) DEFAULT NULL,
  `price` decimal(9,2) DEFAULT NULL,
  `point` decimal(9,2) DEFAULT NULL,
  `nowPrice` decimal(9,2) DEFAULT NULL,
  `picture` varchar(245) DEFAULT NULL,
  `createtime` datetime DEFAULT NULL,
  `createAccount` varchar(20) DEFAULT NULL,
  `updateAccount` varchar(20) DEFAULT NULL,
  `updatetime` datetime DEFAULT NULL,
  `isnew` char(1) DEFAULT 'n',
  `sale` char(1) DEFAULT 'n',
  `hit` int(11) DEFAULT '0',
  `status` int(11) DEFAULT '0' COMMENT '1：新增，2：已上架，3：已下架',
  `productHTML` longtext,
  `maxPicture` varchar(245) DEFAULT NULL,
  `images` varchar(1000) DEFAULT NULL,
  `catalogID` varchar(15) DEFAULT NULL,
  `sellcount` int(11) DEFAULT '0',
  `stock` int(11) DEFAULT '0',
  `searchKey` varchar(45) DEFAULT NULL,
  `title` varchar(80) DEFAULT NULL,
  `description` varchar(145) DEFAULT NULL,
  `keywords` varchar(145) DEFAULT NULL,
  `activityID` varchar(45) DEFAULT NULL,
  `unit` varchar(25) DEFAULT 'item',
  `score` int(11) DEFAULT '0',
  `isTimePromotion` char(1) DEFAULT 'n',
  `giftID` varchar(45) DEFAULT '0' COMMENT '改成发货周期使用字段',
  `taourl` varchar(500) DEFAULT NULL,
  `draft` char(4) DEFAULT NULL,
  `istui` char(1) DEFAULT NULL,
  `quality` varchar(300) DEFAULT NULL,
  `shortname` varchar(60) DEFAULT NULL,
  `ismiao` char(1) DEFAULT NULL,
  `miaoPrice` decimal(10,2) DEFAULT NULL,
  `miaoSta` datetime DEFAULT NULL,
  `miaoEnd` datetime DEFAULT NULL,
  `productType` int(11) DEFAULT NULL COMMENT '产品类型',
  `supplierId` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `product_name` (`name`),
  KEY `product_catalog` (`catalogID`),
  KEY `product_status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=845 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

