INSERT INTO `t_product` VALUES ('227', '鼎烨定制儿童智能手表', '电子商品/时尚电子商品', '1380.00', '180.00', '1100.00', '/attached/image/20170613/儿童手表001_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-13 15:00:33', 'y', 'n', null, '3', '<p>\r\n	鼎烨定制儿童智能手表\r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">支持接打电话、微信、</span><span style=\"line-height:1.5;\">QQ</span><span style=\"line-height:1.5;\">、相机、闹钟、连接手机蓝牙、更有睡眠检测仪和久坐提醒功能。</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\"><img src=\"/mnt/data/img/attached/image/20170613/儿童手表004_3.jpg\" width=\"360\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '7', '/attached/image/20170613/儿童手表002_3.jpg,/attached/image/20170613/儿童手表003_3.jpg', '75', '5', '-1', '', '鼎烨定制儿童智能手表', '鼎烨定制儿童智能手表', '鼎烨定制儿童智能手表', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000119', '', null, null, null, '31', null);
INSERT INTO `t_product` VALUES ('228', 'DY三磁活化能量净水器', '快消商品/生活用品类', '6480.00', '1080.00', '5400.00', '/attached/image/340/911_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 11:35:49', 'y', 'n', null, '3', '<p>\r\n	DY三磁活化能量净水器\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	九芯级深度净化 带来清新山泉水\r\n</p>\r\n<p>\r\n	1.本产品主要部件采用PP熔喷滤芯，UF中空纤维精密膜，高密度活性炭等优质材料制作而成，具有独特的深度净化处理效果，可有效去除水中的有害物质，保留水中的有益矿物质。\r\n</p>\r\n<p>\r\n	2.整机外壳为304不锈钢材质。\r\n</p>\r\n<p>\r\n	3.定期排污节水，不耗电节能环保。\r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">4.出水量适中，可满足家庭饮用水需求。</span> \r\n</p>\r\n<p>\r\n	5.所有部件都符合食品级要求, 安全可靠。\r\n</p>\r\n<p>\r\n	6.所有配件均采用国标配件安装简单。\r\n</p>\r\n<img src=\"/mnt/data/img/attached/image/20170615/净水器002_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170615/净水器003_3.jpg\" width=\"360\" alt=\"\" /> \r\n<p>\r\n	<br />\r\n</p>', '15', null, '70', '35', '96', '', 'DY三磁活化能量净水器', 'DY三磁活化能量净水器', 'DY三磁活化能量净水器', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00012', '', null, null, null, '31', null);
