INSERT INTO `t_product` VALUES ('232', '一叶子面膜', '快消商品/化妆品', '936.00', '156.00', '780.00', '/attached/image/20170611/一叶子面膜008_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-11 14:26:31', 'y', 'n', null, '3', '<p>\r\n	品牌: One Leaf/一叶子\r\n</p>\r\n<p>\r\n	规格：25mlx10片\r\n</p>\r\n<p>\r\n	适合肤质: 肤色暗沉干燥及需要提亮肤色\r\n</p>\r\n<p>\r\n	功效: 保湿补水 滋润 提亮肤色 祛黄 收缩毛孔 &nbsp;改善暗沉肤色\r\n</p>\r\n<p>\r\n	<span>保质期: 3年 &nbsp;&nbsp;</span> \r\n</p>\r\n<p>\r\n	<span><img src=\"/mnt/data/img/attached/image/20170611/一叶子面膜007_3.jpg\" width=\"360\" alt=\"\" /><br />\r\n</span> \r\n</p>', '15', '/attached/image/20170611/一叶子面膜001_3.jpg,/attached/image/20170611/一叶子面膜002-new_3.jpg,/attached/image/20170611/一叶子面膜003_3.jpg,/attached/image/20170611/一叶子面膜004_3.jpg,/attached/image/20170611/一叶子面膜006_3.jpg,/attached/image/mianmo/12_3.jpg', '86', '21', '-24', '', '一叶子面膜', '一叶子面膜', '一叶子面膜', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000123', '', null, null, null, '31', null);
INSERT INTO `t_product` VALUES ('233', '法国原装进口梅洛干红', '快消商品/酒类', '3744.00', '624.00', '3120.00', '/attached/image/20170510/C79CEC9B73B7EABA1449BF47D30023AB_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-10 16:06:21', 'y', 'n', null, '3', '<p>\r\n	&nbsp; &nbsp;优质的红酒中含有一种效力强大的抗氧化剂—白藜芦醇。它是一种天然的抗氧化剂，能软化血管，降低血液粘稠度，保持血液畅通，降低胆固醇，具有抗动脉粥样硬化和冠心病、高血脂的防治作用！&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;优质的红酒中含有丰富的铁，对女性非常有好处，能补血，使脸色红润，具有美容皮肤的功效；其中的抗氧化剂可以促进血液循环，防止脂肪的堆积，对保持妙曼的身材很有帮助！\r\n</p>\r\n&nbsp;优质的红酒当中保存了葡萄皮中所含的一些“酚类物质”，也就是葡萄皮和种籽中所含的有涩味或有颜色的物质。 多酚类物质具有很强的抗氧化作用，对人体心血管具有很强的保护作用，它能减少血液中的“低密度脂蛋白”，降低血液的凝固性，从而降低心肌梗塞、中风等症的危险性，还能预防许多组织器官的老化。其中最著名的保健物质是“白藜芦醇”，它不仅是强力的抗氧化剂，还具有预防癌症的作用。<br />\r\n优质的红酒中含有大量的多酚，每天适度饮用红酒的男性可以中和胃酸治疗胃病，补气血、强经络（烟民喝红酒，患肺癌的风险会逐渐减少，发病率较低！）<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 一般人都知道，每天晚上喝上一两杯红酒会让你的晚餐更完美或是睡得更香甜；希望你能看完后高兴的干上一杯！<br />', '15', '/attached/image/20170510/688DAEC590ACA9F7DFCAC8C8E60560D4_3.jpg,/attached/image/20170510/hj0001_3.jpg', '71', '68', '94', '', '法国原装进口梅洛干红', '法国原装进口梅洛干红', '法国原装进口梅洛干红', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000124', '', null, null, null, '31', null);
INSERT INTO `t_product` VALUES ('234', '诗涵超值美容服务包', '其他', '720.00', '120.00', '600.00', '/attached/image/20170611/诗涵002_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-11 14:59:05', 'y', 'n', null, '3', '诗涵倾情推出“ &nbsp; &nbsp;600 &nbsp; &nbsp; &nbsp;”套餐让鼎烨家人拥抱华贵的气质和优雅尊贵的姿态。<br />\r\n<p>\r\n	在诗涵，遇见最美の自己-----诗涵style健与美生活会所拥有最贴心的服务；最专业的手法；\r\n</p>\r\n<p>\r\n	最前卫、最高端、最科学的美容项目：面部管理、形体管理、健康管理、私密管理、光电中心……用最有效的方法使肌肤重现青春光彩，\r\n</p>\r\n<p>\r\n	使身材越来越凸凹有致，娇美永驻，焕发少女的细润与健美。\r\n</p>\r\n<p>\r\n	武汉地区专享 &nbsp;指定项目\r\n</p>\r\n<p>\r\n	限55岁以下的女性 &nbsp;男士仅限肩颈及面部护理\r\n</p>\r\n<p>\r\n	<span style=\"background-color:#FFFFFF;\">地址：</span><span style=\"background-color:#FFFFFF;\">湖北省武汉市武昌区紫沙路东龙世纪花园（湖北电视台附近）027-87302899</span> \r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170611/诗涵007_3.jpg\" width=\"360\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170611/诗涵001_3.jpg,/attached/image/20170611/诗涵003_3.jpg,/attached/image/20170611/诗涵004_3.jpg,/attached/image/20170611/诗涵005_3.jpg,/attached/image/20170611/诗涵006_3.jpg', '74', '0', '99', '', '诗涵超值美容服务包', '诗涵超值美容服务包', '诗涵超值美容服务包', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000125', '', null, null, null, '31', null);
