INSERT INTO `t_product` VALUES ('293', '彩色能量石', '其他', '828.00', '138.00', '690.00', '/attached/image/20170611/彩色能量石001_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 14:47:54', 'y', 'n', null, '3', '<p>\r\n	<p>\r\n		爆款彩色能量石抗疲劳，抗辐射，抗衰老\r\n	</p>\r\n	<p>\r\n		1.促进血液循环- 将更完善的营养素和氧气输送至细胞内及从细胞内排除毒素，不再出现手脚冰冷的现象。 为血细球供应能量及减低黏性，能减低罹患心血管疾病、心脏病和中风的风险。 增加新陈代谢、促进排毒功能、保持身段苗条。 舒解身体各部位的酸痛、紧绷和僵硬。<br />\r\n2.预防精神疲劳，保持宁心安神，改善睡眠品质。增进精神专注力，有助上班族在工作上取得更佳的表现；有助学生在考试时保持冷静，减少焦虑及在温习时增进注意力。使需长途或经常驾驶的人士感觉更精神，不会感到疲倦或打瞌睡。<br />\r\n3.使身体恢复平衡及力气，并提升身体灵活性老年人行动更有力气和平衡，不会轻易摔倒受伤。运动员如高尔夫球员，能增强体魄、耐力与力气，呈现更好的表现。增强体能、保持青春，使身体更健康、更具活力。<br />\r\n4.强化人体的生物能量场以抗防有害的电磁波。保护人体免受来自围绕着我们的计算机、手机、电器、电讯塔等的电磁波伤害，使身体恢复平衡与协调。\r\n	</p>\r\n</p>', '15', '/attached/image/20170526/c彩色能量石001_3_2.jpg,/attached/image/20170526/c彩色能量石002_3_1.jpg,/attached/image/20170615/彩色能量石004_3.jpg', '74', '154', '81', '', '彩色能量石', '彩色能量石', '彩色能量石', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00018', '', null, null, null, '31', null);
