INSERT INTO `t_product` VALUES ('297', '青海玉树野生虫草（5800）', '快消商品/特产类', '5800.00', '720.00', '3360.00', '/attached/image/dongchongxiacao/07_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-14 12:15:21', 'y', 'n', null, '3', '<p>\r\n	青海玉树野生虫草（5800）\r\n</p>\r\n<p>\r\n	8支*0.25g\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170613/虫草009_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170614/虫草010_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;\">青海玉树冬虫夏草生长在青海玉树地区海拔4500-6000米以上的高山上，以生理特性强、使用价值高、个大而在海内外享有盛誉，也是全世界品质较高的冬虫夏草。一年一度的冬虫夏草交易节的虫草王评选上，玉树冬虫夏草连续数年蝉联冠军宝座。每年5~6月份，当冰雪融化时，藏族同胞们便唱着歌，拎着镢头，进山寻找冬虫夏草。</span><span style=\"color:#E53333;\"></span> \r\n</p>', '15', '/attached/image/20170613/虫草003_3.jpg,/attached/image/20170613/虫草004_3.jpg,/attached/image/20170613/虫草005_3.jpg,/attached/image/20170613/虫草006_3.jpg,/attached/image/20170613/虫草007_3.jpg,/attached/image/20170613/虫草008_3.jpg', '76', '0', '95', '', '青海玉树野生虫草（5800）', '青海玉树野生虫草（5800）', '青海玉树野生虫草（5800）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000183', '', null, null, null, '31', null);
