INSERT INTO `t_product` VALUES ('308', '长白山林人参礼盒', '快消商品/特产类', '2772.00', '462.00', '2310.00', '/attached/image/rencan/8_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-10 16:54:56', 'y', 'n', null, '3', '长白山林人参礼盒\r\n<p class=\"MsoNormal\">\r\n	<span>单位：</span>2<span>支</span><span>/</span><span>盒</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0000pt;\">\r\n	产品描述及功效：人参是非常名贵的滋补品，是东北特产之一，因其产量稀少而滋补效果显著，具有补五脏，安精神，男女一切虚症，肢冷脉微，术后复原，具有补气强身，延缓衰老之功效！\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0000pt;\">\r\n	适用人群：久病体弱及身体虚寒，活动后心慌气短，血压偏低，妇女产后体虚，老年性体虚无力，贫血等！青年人服用人参精力更旺盛！\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	食用方法：可炖鸡汤及排骨汤等（人参味浓，可用半支参）\r\n</p>', '15', null, '76', '87', '92', '', '长白山林人参礼盒', '长白山林人参礼盒', '长白山林人参礼盒', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000194', '', null, null, null, '31', null);
