INSERT INTO `t_product` VALUES ('346', '亚麻籽油', '快消商品/食品类', '318.00', '42.00', '270.00', '/attached/image/20170606/亚麻籽油2_3.png', '2017-04-28 14:16:52', '', '15827476130', '2017-06-06 18:28:57', 'y', 'n', null, '3', '<span style=\"color:#4A4A4A;font-family:微软雅黑, \'Microsoft YaHei\';font-size:14px;background-color:#FFFFFF;\">中国有句老话，“开门七件事，柴米油盐酱醋茶”，其中食用油的作用不可小觑，它既增加了饭菜的色香味，还提供了人体所需的热量和营养。市场上的食用油，类型繁多，成分各异，哪种油是首选？很多人都推荐亚麻籽油，认为亚麻籽油更有利于人体健康。对于老年人，在做菜时使用亚麻籽油，有助于预防老年痴呆症。对于孕产妇，摄入足量的亚麻酸，可使婴儿的脑神经细胞和视神经细胞发育更好。而对于少年学子，适量补充亚麻籽油可以保障孩子大量用脑、用眼的需求，因而亚麻籽油被誉为食用油中的“液体黄金”。</span>', '15', '/attached/image/you/TB2aM85bypnpuFjSZFkXXc4ZpXa_!!2086084218_3.jpg,/attached/image/you/TB2cFh4bt0opuFjSZFxXXaDNVXa_!!2086084218_2.jpg,/attached/image/you/TB2xxlYbC4mpuFjSZFOXXaUqpXa_!!2086084218_1.jpg', '85', '460', '-99', '', '亚麻籽油', '亚麻籽油', '亚麻籽油', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00047', '', null, null, null, '31', null);
