INSERT INTO `t_product` VALUES ('495', '彩色能量石', '其他', '1200.00', '1350.00', '210.00', '/attached/image/20170611/彩色能量石001_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 15:01:29', 'y', 'n', null, '3', '<p>\r\n	爆款彩色能量石抗疲劳，抗辐射，抗衰老\r\n</p>\r\n<p>\r\n	1.促进血液循环- 将更完善的营养素和氧气输送至细胞内及从细胞内排除毒素，不再出现手脚冰冷的现象。 为血细球供应能量及减低黏性，能减低罹患心血管疾病、心脏病和中风的风险。 增加新陈代谢、促进排毒功能、保持身段苗条。 舒解身体各部位的酸痛、紧绷和僵硬。<br />\r\n2.预防精神疲劳，保持宁心安神，改善睡眠品质。增进精神专注力，有助上班族在工作上取得更佳的表现；有助学生在考试时保持冷静，减少焦虑及在温习时增进注意力。使需长途或经常驾驶的人士感觉更精神，不会感到疲倦或打瞌睡。<br />\r\n3.使身体恢复平衡及力气，并提升身体灵活性老年人行动更有力气和平衡，不会轻易摔倒受伤。运动员如高尔夫球员，能增强体魄、耐力与力气，呈现更好的表现。增强体能、保持青春，使身体更健康、更具活力。<br />\r\n4.强化人体的生物能量场以抗防有害的电磁波。保护人体免受来自围绕着我们的计算机、手机、电器、电讯塔等的电磁波伤害，使身体恢复平衡与协调。\r\n</p>', '15', '/attached/image/20170526/c彩色能量石001_3_2.jpg,/attached/image/20170526/c彩色能量石002_3_1.jpg,/attached/image/20170615/彩色能量石004_3.jpg', '74', '0', '100', '', '彩色能量石', '彩色能量石', '彩色能量石', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00018', '', null, null, null, '37', null);
INSERT INTO `t_product` VALUES ('498', '玉树虫草8条+诺木黑枸杞800g(12000)', '快消商品/特产类', '12000.00', '10000.00', '2100.00', '/attached/image/dongchongxiacao/11_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-16 22:18:15', 'y', 'n', null, '3', '<p>\r\n	玉树虫草8条+诺木黑枸杞800g(12000)\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:30.0000pt;\">\r\n	冬虫夏草又名虫草，是我国民间惯用的一种名贵滋补药材，其营养成分高于人参，可入药，也可食用，是上乘的佳肴，具有很高的营养价值。冬虫夏草可以增强机体的免疫力，滋补肺肾，对肺癌、肝癌等有明显的抑制作用。在临床上对肺虚久咳，气喘，肺结核咯血，盗汗，肾虚腰膝酸痛，阳痿遗精，神经衰弱及化疗、放疗后的红细胞下降都有疗效。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:30.0000pt;\">\r\n	<span>冬虫夏草为虫体与菌座相连而成，全长</span>9<span>～</span><span>12</span><span>厘米。虫体如三眠老蚕，长约</span><span>3</span><span>～</span><span>6</span><span>厘米，粗约</span><span>0.4</span><span>～</span><span>0.7</span><span>厘米。外表呈深黄色，粗糙，背部有多数横皱纹，腹面有足</span><span>8</span><span>对，位于虫体中部的</span><span>4</span><span>对明显易见。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:30.0000pt;\">\r\n	<span>断面内心充实，白色，略发黄，周边显深黄色。菌座自虫体头部生出，呈棒状，弯曲，上部略膨大。表面灰褐色或黑褐色，长可达</span>4<span>～</span><span>8</span><span>厘米，径约</span><span>0.3</span><span>厘米。折断时内心空虚，粉白色。臭微，味淡。以虫体色泽黄亮、丰满肥大、断面黄白色、菌座短小者为佳。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', null, '76', '0', '100', '', '玉树虫草8条+诺木黑枸杞800g(12000)', '玉树虫草8条+诺木黑枸杞800g(12000)', '玉树虫草8条+诺木黑枸杞800g(12000)', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000182', '', null, null, null, '37', null);
