INSERT INTO `t_product` VALUES ('543', '龙泉青瓷茶具', '快消商品/茶类', '1200.00', '1000.00', '210.00', '/attached/image/20170611/龙泉青瓷茶具001_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-11 15:57:06', 'y', 'n', null, '3', '龙泉青瓷大师徐新建监制作品', '15', '/attached/image/20170611/龙泉青瓷茶具002_3.jpg,/attached/image/20170611/龙泉青瓷茶具003_3.jpg', '84', '0', '100', '', '龙泉青瓷茶具', '龙泉青瓷茶具', '龙泉青瓷茶具', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00042', '', null, null, null, '37', null);
INSERT INTO `t_product` VALUES ('544', '蓝莓发酵原液', '快消商品/食品类', '1200.00', '1000.00', '210.00', '/attached/image/20170611/蓝莓002_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-11 16:11:48', 'y', 'n', null, '3', '<p>\r\n	蓝莓发酵原液\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\">\r\n	<span>蓝莓的花青素含量排名第一。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\">\r\n	<span>花青素是纯天然的抗衰老的营养补充剂，研究证明是当今人类发现最有效的抗氧化剂，它的抗氧化性能比维生素</span>E高出五十倍，比维生素C高出二百倍，<span>是目前自然界最有效的抗氧化物质。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1.增进视力 &nbsp;2.<b>&nbsp;</b><span>美容</span> &nbsp;3. 改善睡眠\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4.<b>&nbsp;</b><span>加固血管、改善循环</span> &nbsp;5.<b>&nbsp;</b><span>预防肿瘤</span> &nbsp;6. 增强记忆力\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170523/蓝莓发酵原液001_3.jpg,/attached/image/20170523/蓝莓发酵原液002_3.jpg,/attached/image/20170611/蓝莓004_3.jpg', '85', '0', '100', '', '蓝莓发酵原液', '蓝莓发酵原液', '蓝莓发酵原液', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00043', '', null, null, null, '37', null);
INSERT INTO `t_product` VALUES ('545', '养生足弓器', '快消商品/生活用品类', '1200.00', '1450.00', '210.00', '/attached/image/jiaotie/3_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-11 16:14:32', 'y', 'n', null, '3', '<p>\r\n	养生足弓器\r\n</p>\r\n<p>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">1.调整足弓: (促进骨架平衡) 。</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">2.调理神经系统:改善脊椎不整，调理神经传导 。</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">3.足底按摩:能量按摩涌泉穴(贤脏)与脏腑反射区、促进足底六条经络(</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">肝.脾.肾.胃. 胆.膀胱) 之循环代谢 。</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">4.纳米远红外线光波能量功效:促进血液循环、活化细胞。(能量共振-效</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">果神奇)&nbsp;</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">5.养生芯片:调理内分泌整体的平衡增强免疫力。</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">6.纳米负离子效应:高单位的负离子,可有效的舒缓压力，恢复体力，排</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">除疲劳。&nbsp;</span>\r\n	</div>\r\n	<div style=\"color:#666666;padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">7.杀菌功能:对金黄色葡萄球，大肠杆菌，霉菌有杀菌、除臭功能。</span>\r\n	</div>\r\n</p>', '15', null, '70', '0', '100', '', '养生足弓器', '养生足弓器', '养生足弓器', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00044', '', null, null, null, '37', null);
INSERT INTO `t_product` VALUES ('548', '亚麻籽油', '快消商品/食品类', '1200.00', '405.00', '210.00', '/attached/image/20170606/亚麻籽油2_3.png', '2017-04-28 14:16:52', '', '15827476130', '2017-06-06 18:30:05', 'y', 'n', null, '3', '<p>\r\n	蒙古顶级亚麻籽油\r\n</p>\r\n<p>\r\n	<span style=\"color:#000000;font-family:微软雅黑, \'Microsoft YaHei\';font-size:14px;line-height:21px;\">中国有句老话，“开门七件事，柴米油盐酱醋茶”，其中食用油的作用不可小觑，它既增加了饭菜的色香味，还提供了人体所需的热量和营养。市场上的食用油，类型繁多，成分各异，哪种油是首选？很多人都推荐亚麻籽油，认为亚麻籽油更有利于人体健康。对于老年人，在做菜时使用亚麻籽油，有助于预防老年痴呆症。对于孕产妇，摄入足量的亚麻酸，可使婴儿的脑神经细胞和视神经细胞发育更好。而对于少年学子，适量补充亚</span><span style=\"color:#4A4A4A;font-family:微软雅黑, \'Microsoft YaHei\';font-size:14px;line-height:21px;\"><span style=\"color:#000000;\"></span><span style=\"color:#000000;\">麻籽油可以保障孩子大量用脑、用眼的需求，因而亚麻籽油被誉为食用油中的“液体黄金”。</span></span><span style=\"color:#000000;\"></span> \r\n</p>', '15', null, '85', '1', '100', '', '亚麻籽油', '亚麻籽油', '亚麻籽油', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00047', '', null, null, null, '37', null);
