INSERT INTO `t_product` VALUES ('631', 'k歌神麦（送支架）', null, '4600.00', null, '1890.00', '/attached/image/20170505/微信图片_20170505161035_3.jpg', '2017-05-05 16:33:38', '15827476130', '18824222366', '2017-05-12 16:08:14', 'n', 'n', '1153', '3', 'K歌神器麦克风专利号:201630341701.1<br />\r\n优点：<br />\r\n支持苹果IOS及ANDROID系统的手机或平板.️<br />\r\n无线蓝牙连接，使用TF卡（MP3）听音乐，优先播放内储存的歌曲，解决手机不在身边的烦恼。<br />\r\n自由同步APP音乐播放软件（全民K歌、唱吧、天籁K歌、演唱汇、酷狗音乐等各大流行K歌软件）<br />\r\n内置1500mAh锂电池，长达5–7小时续航，自带高品质双喇叭、调音台。<br />\r\n随时随地K歌/听歌/练歌。会议、活动主持、生日家庭聚会、学习播音主持的学生。<br />\r\n&nbsp; &nbsp; &nbsp; 神奇的麦克风专为喜欢音乐的朋友们量身打造，它带给您的不仅仅是快乐，更多的是高品质的生活和享受<br />', '15', '/attached/image/20170505/图片1_3.png,/attached/image/20170505/图片2_3.png,/attached/image/20170505/图片3_3.png,/attached/image/20170505/微信图片_20170505161101_1.jpg,/attached/image/20170505/微信图片_20170505161140_1.jpg,/attached/image/20170505/微信图片_20170505161145_2.jpg', '67', '102', '-2', null, 'k歌神麦', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000251', null, null, null, null, '31', null);
