:bold;\"><span>天龙八步</span> <span>、泡泡糖、花开花落、金龙拍拍操等。</span></span></b><b><span style=\"font-family:\'Times New Roman\';font-size:10.5pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><img alt=\"\" src=\"/attached/image/20170521/88-相亲_3.jpg\" /></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b>&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:黑体;color:#ff0000;font-size:12pt;font-weight:bold;\"><span>团队组建目的：</span></span></b><span style=\"font-family:宋体;font-size:12pt;\"><span>新颖别致的破冰项目，也是拓展培训的一个重要环节，意在建立团队文化。团队成员群策群力，利用有限资源，激情发挥，大胆创新，充分展示参训人员的创意与激情集众人智慧，浓缩创新意识，展示团队风采，迅速形成一支拥有共同使命感的团队，营造活泼生动的团队氛围，消除隔阂，增进团队成员间的凝聚力。</span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>&nbsp;</span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>1：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>爱如潮水</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>邀请配对男女嘉宾上台进行纸杯传水游戏，游戏规则为每对男女嘉宾为一组，选三组嘉宾到台上参加游戏。游戏开始男女嘉宾依靠嘴上的纸杯向目标量水杯中传水，此过程不能用手触碰水杯，计时一分钟，时间结束时量水杯中水量最多的一组获胜。</span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><img alt=\"\" src=\"/attached/image/20170521/99-相亲_3.jpg\" /></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>&nbsp;</span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>2：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>背人大战</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:11pt;\"><span>本节游戏开始，男女双方分两组上台进行对抗。游戏选定一名男生代表和一名女生代表作为背人者，后面队伍中的选手轮流骑到背人者的背上进行石头、剪刀、布游戏，赢的换下一位选手直到队伍中所有人都背过了为最终胜利。游戏输的一方将接受赢的一方做出的惩罚。</span></span><span style=\"font-family:宋体;font-size:11pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>3：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>恋请猜猜看</span>·心有灵犀</span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:11pt;\"><span>所有人员共分</span>5大组，每大组出一对，其中一人a看题板模仿动作，另外一人猜，各有3个题目，可以选择过，可以选择向队友求援，救援者也采用模仿动作的方式进行。3个题目一过，获一组。其他人可以干扰别组的人。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:11pt;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>4：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>指压板接力赛</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\">&nbsp;</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:9pt;font-weight:bold;\">&nbsp;</span></b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:9pt;\"><span>指压板挑战分为三个项目进行</span>,激情跳大绳、猪八戒背媳妇、幸福碰碰碰、旋风接力、仰卧起坐10个（体重最大的做，女生压腿）</span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:9pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:9pt;\"><span>项目目标：</span>5个项目连续进行。哪个队用时最少的获胜。</span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:9pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:9pt;\"><span>活动当中体验团队精神的同时，增加大家的积极性，互动性。</span></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:9pt;font-weight:bold;\"></span></b>&nbsp;</b> \r\n</p>\r\n<b> \r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:11pt;\"></span><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span><img src=\"file://C:/Users/ADMINI~1/AppData/Local/Temp/ksohtml/wpsFCC9.tmp.png\" width=\"301\" height=\"193\" /></span><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>5：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>大型相亲篝火晚会</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#0218be;font-size:10pt;\"><span>备注</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>：每个组出两个节目晚会开始之前报给教练</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\">&nbsp;<span>晚间主题活动：</span> “</span><span style=\"font-family:宋体;background:#ffffff;color:#ff0000;font-size:10pt;\"><span>狂欢篝火晚会</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\">”</span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>活动介绍：</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>第一项</span> &nbsp;<span>点火仪式，热身舞蹈：</span></span><span style=\"font-family:宋体;background:#ffffff;color:#ff0000;font-size:10pt;\"><span>洗衣舞、社会摇</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>每小组出一个节目</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>小组</span>pk项目：转纸巾</span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>每小组出二个节目</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>小组</span>pk项目：</span><span style=\"font-family:宋体;background:#ffffff;color:#ff0000;font-size:10pt;\"><span>时装秀</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>（红高粱模特队）</span></span><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>宣布篝火晚会圆满结</span></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>&nbsp;</span></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span></span><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>九、安全保证：</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;background:#ffffff;\" class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:宋体;color:#ff0000;font-size:12pt;font-weight:bold;\"><span>为了保证本次拓展效果，保障活动人员的安全，请您认真阅读并遵守一下相关说明：</span></span></b><b><span style=\"font-family:宋体;color:#ff0000;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"><span>关于安全</span>:</span></u></b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>拓展训练始终如一地将安全保障放在各项工作的首位，所有活动均经过精心的设计与实验。一</span></span><span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>流的专业器材、丰富经验的培训师，让您在百分百安全中体验快乐、提升自我、熔炼团队。</span></span><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>学员准备：</span></span></b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"></span></u></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>着运动装（女士请着长裤！！）、穿运动鞋，切勿穿高跟鞋、拖鞋、凉鞋</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>住宿的学员请备好足够的换洗衣服</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>请做好防晒工作，准备好防晒霜等物品</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>积极开放的心态将有助您取得良好成绩</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>相信团队的力量，相互协作、积极沟通、主动参与</span></span><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>注意事项：</span></span></b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">1、以下情况不允许参加训练:心脏病、脑淤血、癫痫、孕妇、习惯性脱臼、较重的颈</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>椎腰椎疾病、骨坏死、肌无力，以及各种传染病正处于发病期的患者。</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">2、其它疾病和身体残疾的学员须预先申明，在得到培训师允许的情况下方可参加培训；但培训中仍须随时与培训师保持沟通和确认。</span><b><span style=\"font-family:\'Times New Roman\';color:#0000ff;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">3、培训休息期间请勿攀爬基地内的各类训练设施，以免发生意外</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">4、培训期间请服从培训师和基地人员的管理，课余期间严禁喝酒和赌博</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">5、培训期间，请不要离开您所在的小组单独活动，如有困难请向培训师要求帮助</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">6、在培训中，您身体如有不适，请及时向本队队长和培训师通报</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">7、在培训中请爱护基地内的各项设施以及自然环境，不要乱丢垃圾</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>出行要求：</span></span></b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"></span></u></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">1、在规定的时间到达指定集合场地，风雨无阻（我们会备足雨具，雨中活动效果更佳）</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">2、按照规定着装（运动装为宜，女士不能穿裙子），佩戴活动专用帽</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">3、穿较为防滑的旅游鞋或运动鞋，请勿穿皮鞋、高跟鞋</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">4、根据天气预报，结合自身身体状况酌情携带、添加衣物</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">5、根据自身情况携带私用药品</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>环保要求：</span></span></b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"></span></u></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>我们倡导无踪迹出行，拓展期间的所有垃圾都要回收到指定存放区域。</span></span> </b> \r\n</p>\r\n<b> \r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span></span></span><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b>&nbsp;\r\n</p>\r\n</b></b> \r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b>&nbsp;\r\n</p>', '15', '/attached/image/20170521/22-相亲_3.jpg,/attached/image/20170521/33-相亲_3.jpg,/attached/image/20170521/44-相亲_3.jpg,/attached/image/20170521/55-相亲_3.jpg,/attached/image/20170521/DDDD_3.jpg', '74', '12', '999', null, '木兰草原相亲趣味拓展', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z1111xiangqin', null, null, null, null, '31', null);
