INSERT INTO `t_product_kd` VALUES ('28', '诺木洪野生黑枸杞', '快消商品/特产类', '1380.00', '1000.00', '1200.00', '/attached/image/20170506/3瓶  -1000_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-01 17:31:17', 'y', 'n', null, '2', '<p>\r\n	<p>\r\n		青海诺木洪野生黑枸杞\r\n	</p>\r\n	<p>\r\n		<span style=\"color:#E53333;\">150g（礼盒装）</span>\r\n	</p>\r\n	<p>\r\n		<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\"><span style=\"color:#E53333;\">主要出产于</span><span style=\"color:#E53333;\">青海、</span><span style=\"color:#E53333;\"></span><span style=\"color:#E53333;\">甘肃酒泉，新疆，内蒙，西藏等沙漠地带，海拔高气候干旱、生态环境洁净、无污染。经测定，</span></span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%BB%91%E6%9E%9C%E6%9E%B8%E6%9D%9E\"><span style=\"color:#E53333;\">黑果枸杞</span></a><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">含有17种氨基酸，13种微量元素，其中钙、镁、铜锌、铁的含量也高于红枸杞</span><span style=\"font-weight:700;color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">。</span><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">来自于青海柴达木盆地诺木洪核心产区，海拔3000米的盆地沙漠地带，海拔高、气候干旱、昼夜温差大、生态环境洁净、无污染。其当地0px－250px土层土壤含盐量可达8.9%，250px—750px土层土壤含盐量可达5.1%，可见黑枸杞耐盐碱能力特强，拥有着极强的生命力。由于其生长环境特殊、采摘难度大、采摘产量小、具有独特的功效和神奇的色香味，造就了黑枸杞这稀少珍贵的原生态滋补佳品。</span>\r\n	</p>\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/dongchongxiacao/微信图片_20170414154723_2.jpg\" alt=\"\" />\r\n</p>', '15', '/attached/image/dongchongxiacao/013_3.jpg,/attached/image/dongchongxiacao/15_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414154716_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414154732_1.jpg,/attached/image/dongchongxiacao/微信图片_20170414154736_2.jpg', '76', '25', '100', '', '诺木洪野生黑枸杞', '诺木洪野生黑枸杞', '诺木洪野生黑枸杞', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000113', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('29', '西藏那区草山野生虫草', '快消商品/特产类', '6670.00', '5000.00', '5800.00', '/attached/image/20170506/野生虫草_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-12 14:53:45', 'y', 'n', null, '2', '西藏那区草山野生虫草', '15', null, '76', '3', '100', '', '西藏那区草山野生虫草', '西藏那区草山野生虫草', '西藏那区草山野生虫草', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000116', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('30', '青海玉树野生虫草02（12000）', '快消商品/特产类', '13800.00', '10000.00', '12000.00', '/attached/image/20170504/21_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-14 15:29:52', 'y', 'n', null, '2', '<p>\r\n	青海玉树野生虫草02\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">18支*0.25g(礼盒随机)</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\"><img src=\"/mnt/data/img/attached/image/20170614/虫草010_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170613/虫草009_3.jpg\" width=\"360\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';font-size:14px;background-color:#FFFFFF;\">冬虫夏草是一种药物名，它的外形特别奇特，冬天是虫子，夏天却是草。那么它是怎样从虫子转为草的?夏天一种称为虫草菌的真菌孢子成熟散落后萌发成菌丝钻到蝠蛾的幼虫身体内，吸取幼虫体内的营养。蝠蛾的幼虫躲进土壤中，这时虫草菌长出很多丝状体，称为菌丝体。幼虫由于体内的营养物质被吸完，只剩下僵死的空壳，当然不能变成蝠蛾了。第二年春夏，气温和天气合适，菌丝体从幼虫的口器中长出，伸出地面。顶端略为膨大，外形像根棒，表面有许多小球形孢子。这些孢子可在空气中飞舞传播，草丛里不知又有多少蝠蛾幼虫将成为这些孢子的生活场所。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/dongchongxiacao+ertongzhinengshoubiao/2_3.jpg,/attached/image/dongchongxiacao+ertongzhinengshoubiao/3_3.jpg,/attached/image/dongchongxiacao/02_3.jpg,/attached/image/dongchongxiacao/04_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414142148_2.jpg', '76', '65', '100', '', '青海玉树野生虫草02', '西藏那区草山野生虫草02', '西藏那区草山野生虫草02', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000117', '', null, null, null, '38', null);
