INSERT INTO `t_product_kd` VALUES ('38', '法国原装进口梅洛干红', '快消商品/酒类', '2000.00', '1000.00', '1780.00', '/attached/image/20170511/h梅洛干红-1000_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 21:20:44', 'y', 'n', null, '3', '&nbsp; 优质的红酒中含有一种效力强大的抗氧化剂—白藜芦醇。它是一种天然的抗氧化剂，能软化血管，降低血液粘稠度，保持血液畅通，降低胆固醇，具有抗动脉粥样硬化和冠心病、高血脂的防治作用！<br />\r\n&nbsp; 优质的红酒中含有丰富的铁，对女性非常有好处，能补血，使脸色红润，具有美容皮肤的功效；其中的抗氧化剂可以促进血液循环，防止脂肪的堆积，对保持妙曼的身材很有帮助！<br />\r\n&nbsp; 优质的红酒当中保存了葡萄皮中所含的一些“酚类物质”，也就是葡萄皮和种籽中所含的有涩味或有颜色的物质。 多酚类物质具有很强的抗氧化作用，对人体心血管具有很强的保护，它能减少血液中的“低密度脂蛋白”，降低血液的凝固性，从而降低心肌梗塞、中风等症的危 &nbsp; &nbsp;险性，还能预防许多组织器官的老化。其中最著名的保健物质是“白藜芦醇”，它不仅是强力的抗氧化剂，还具有预防癌症的作用。作用<br />\r\n&nbsp; 优质的红酒中含有大量的多酚，每天适度饮用红酒的男性可以中和胃酸治疗胃病，补气血、强经络（烟民喝红酒，患肺癌的风险会逐渐减少，发病率较低！）<br />\r\n<p>\r\n	&nbsp; &nbsp; 一般人都知道，每天晚上喝上一两杯红酒会让你的晚餐更完美或是睡得更香甜；希望你能看完后高兴的干上一杯！\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170510/hj0001_3.jpg,/attached/image/20170510/hj0002_3.jpg', '71', '0', '100', '', '法国原装进口梅洛干红', '法国原装进口梅洛干红', '法国原装进口梅洛干红', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000124', '', null, null, null, '38', null);
