INSERT INTO `t_product_kd` VALUES ('93', '鼎烨定制套餐真皮男女包', '快消商品/生活用品类', '26450.00', '20000.00', '23000.00', '/attached/image/dongchongxiacao+ertongzhinengshoubiao/双包4_3.jpg', '2017-04-28 14:16:52', '', 'admin', '2017-05-03 08:50:17', 'y', 'n', null, '3', '鼎烨定制套餐真皮男女包', '15', null, '70', null, '100', '', '鼎烨定制套餐真皮男女包', '鼎烨定制套餐真皮男女包', '鼎烨定制套餐真皮男女包', null, 'item', '0', 'n', '', '', '0', '', '', 'A000175', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('94', '正品虫草14条+黑枸杞1500g(23000)', '快消商品/特产类', '26450.00', '20000.00', '23000.00', '/attached/image/20170505/yyyyyy_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-12 14:48:44', 'y', 'n', null, '2', '<p>\r\n	青海玉树野生虫草14条+诺木洪野生黑枸杞1500g(23000)\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">礼盒随机、绝对正品、产地直供、贵族套装</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp; 传统的冬虫夏草吃法</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;1.煮水当茶喝</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草不应该泡水喝，而是应该煮水喝，正确煮冬虫的方法是，把冬虫夏草加水一杯左右，用小火煮十分钟，，然后立刻把水倒出来喝，然后再加水煮十分钟，倒出来喝完后，再加水煮，这样反复添水煮，直到冬虫夏草水煮出来的水变淡。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;</span><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">2.与肉类炖吃</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草炖出来的口感非常绵香，把冬虫夏草与肉类炖着吃是最适合的，但一定要注意，冬虫夏草不可以炖太长时间，这样容易令冬虫夏草的营养流失掉，一般冬虫夏草炖半小时是最适合的，而冬虫夏草与不同的肉类炖，其保健功效也不同。民间传说，1764年，53岁时的乾隆皇帝犯了头晕腰痛病，吃遍了宫中御医开的药，感觉就是不理想。有一天，他偶然对宠臣和珅说起自己的身体情况。和珅当然不会错过这个讨好乾隆的机会，便将与自己交好的民间郎中引荐给乾隆。郎中给乾隆皇帝把了脉后，开了如下的药方：冬虫夏草、枸杞、山药、乌鸡，乾隆依言连续服用。一年之后，乾隆身体恢复如初，头晕腰痛等不适症状不但消失得无踪无影，而且还感觉精力大增。乾隆大奇，问郎中为何仅靠三味药就解决了御医们的难题。郎中说这份功劳当属采自西藏的冬虫夏草，肾主精，肾虚则精损，冬虫夏草补肺肾，益精气，理诸虚百损。冬虫夏草是集养生、保健和治疗于一身的山珍。它不但能补肾，而且长年服用还可以延缓衰老。乾隆得知冬虫夏草有如此好处，就令郎中再施妙手，终身享用。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;3.研粉服用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">如果嫌把冬虫夏草煮水或炖汤喝麻烦，那么还有一个非常简单方便的方法，就是把冬虫夏草用研磨机研成粉末，然后装入到胶囊中，这样就可以方便携带，每天都能定时服用了。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草非常适合人们用来</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E6%8F%90%E9%AB%98%E5%85%8D%E7%96%AB%E5%8A%9B\"><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">提高免疫力</span></a><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">，或者是术后、产后身体的恢复，可是如果食用方法不当，往往不能充分发挥它的营养作用。关于冬虫夏草的吃法，网上流传着很多种说法，有的说泡水喝，有的说炖着吃，有人说研成粉末，还有的说可以直接嚼着吃。到底冬虫夏草怎么吃比较好呢？</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">比较简单而又有效的方法：</span> \r\n</div>\r\n<ol class=\"custom_num para-list list-paddingleft-1\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<li class=\"list-num-1-1 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">煮水当茶喝，而不是用开水泡着喝，此法简单有效。通常，冬虫夏草一次要煮6～10分钟，注意要用文火，煮沸时间短，水开后要马上喝，边喝边添水，在冬虫夏草水颜色最深的时候是营养最丰富的时候，这个时候的水一定不要浪费。通常冬虫夏草水会经历一个由淡到浓再转淡的过程，余味也很绵长。在冬虫夏草水变淡甚至呈现白色的时候就不要喝了，可以把冬虫夏草吃掉。一壶</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%86%AC%E8%99%AB%E5%A4%8F%E8%8D%89%E8%8C%B6\"><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草茶</span></a><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">能喝上至少半个小时，添水4～6次。</span> \r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-2 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">跟肉类产品炖着吃，此法为传统</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%99%AB%E8%8D%89\"><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">虫草</span></a><span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">宴吃法，结合不同的肉类品种，功效有一定的差别，详情可见下面的一些常见食谱。此法缺点是不适合每日坚持长期食用。</span> \r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-3 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">用来泡药酒喝。</span> \r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-4 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">使用研磨机将冬虫夏草磨成粉，装进胶囊盒中随身携带，每日定时服用。此法在卫生方面较为有隐患，若不是每日定期服用，不推荐使用。</span> \r\n		</div>\r\n	</li>\r\n</ol>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/dongchongxiacao/011_3.jpg,/attached/image/dongchongxiacao/18_3.jpg,/attached/image/dongchongxiacao/19_3.jpg,/attached/image/dongchongxiacao/20_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414142202_3.jpg', '76', '3', '100', '', '青海玉树正品虫草14条+诺木洪野生黑枸杞1500g(23000)', '正品虫草14条+黑枸杞1500g(23000)', '正品虫草14条+黑枸杞1500g(23000)', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000176', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('95', '诺木洪黑枸杞（5800）', '快消商品/特产类', '6670.00', '5000.00', '5800.00', '/attached/image/20170504/69_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-09 14:55:53', 'y', 'n', null, '2', '诺木洪黑枸杞（5800）', '15', null, '76', '33', '100', '', '诺木洪黑枸杞（5800）', '诺木洪黑枸杞（5800）', '诺木洪黑枸杞（5800）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000177', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('96', '玉树野生虫草20条+诺木黑枸杞2000g（34000）', '快消商品/特产类', '39100.00', '30000.00', '34000.00', '/attached/image/20170505/fffffff_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-09 16:01:25', 'y', 'n', null, '2', '<p>\r\n	青海玉树野生虫草20条+诺木黑枸杞2000g（34000）\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;\">礼盒随机、贵族套装、滋补佳品</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">&nbsp; &nbsp; &nbsp;诺木洪枸杞为茄科枸杞属植物。枸杞子性平、味甘、入肝肾二经。功能补肝肾、监筋骨、补血液、润肺益气、助阳。 诺木洪枸杞的药用价值大大高于普通枸杞，被誉为\"软黄金\"。诺木洪枸杞中富含氨基酸、维生素等100多种人体必需的营养元素，含有人体所需的18种氨基酸、丰富的还原糖、维生素以及钙、磷、铁等营养成分，并含锗、硒、酮等具有抗癌、抗衰老、美容等功效的微量元素，具有极高的药用价值。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp;</span><span style=\"color:#E53333;\">诺木洪枸杞果实（中药称枸杞子），药用功能与宁夏枸杞同；根皮（中药称</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%9C%B0%E9%AA%A8%E7%9A%AE\"><span style=\"color:#E53333;\">地骨皮</span></a><span style=\"color:#E53333;\">），有解热止咳之效用。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">&nbsp; &nbsp; &nbsp;采收加工</span><span style=\"color:#E53333;\">：枸杞子：6-11月果实陆续红熟，要分批采收，迅速将鲜果摊在芦蔗上，厚不超过3厘米，一般以1.5厘米为宜，放阴凉处晾至皮皱，然后曝晒至果皮起硬，果肉柔软时去果柄，再晒干。枸杞叶：春季至初夏采摘，洗净，多鲜用。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp;</span><span style=\"color:#E53333;\">主要成分：</span></span><span style=\"color:#E53333;\">枸杞子含</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E7%94%9C%E8%8F%9C%E7%A2%B1\"><span style=\"color:#E53333;\">甜菜碱</span></a><span style=\"color:#E53333;\">（betane），</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%98%BF%E6%89%98%E5%93%81\"><span style=\"color:#E53333;\">阿托品</span></a><span style=\"color:#E53333;\">（atropine），</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%A4%A9%E4%BB%99%E5%AD%90%E8%83%BA\"><span style=\"color:#E53333;\">天仙子胺</span></a><span style=\"color:#E53333;\">（gyoscyamine）。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">&nbsp; &nbsp; &nbsp;枸杞多糖：</span><span style=\"color:#E53333;\">枸杞多糖是一种水溶性多糖，是枸杞中最主要的活性成分，相对分子质量为68-200，成为国内外研究热点。其中又以枸杞多糖的免疫调节和抗肿瘤作用的研究最多。现已有很多研究表明枸杞多糖具有促进免疫、抗衰老、抗肿瘤、清除自由基、抗疲劳、抗辐射、保肝、生殖功能保护和改善等作用。[8-10]</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">&nbsp; &nbsp; &nbsp;甜菜碱</span><span style=\"color:#E53333;\">：化学名称为1-</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E7%BE%A7%E5%9F%BA\"><span style=\"color:#E53333;\">羧基</span></a><span style=\"color:#E53333;\">-N，N，N-三甲氨基乙内酯，在化学结构上与氨基酸相似，属于季胺碱类物质。甜菜碱是枸杞果、叶、柄中主要的生物碱之一。枸杞对脂质代谢或抗脂肪肝的作用主要是由于所含的甜菜碱引起的，它在体内起甲基供应体的作用。关于枸杞甜菜碱的研究仅限于国内在含量的测定、提取工艺和对枸杞植物的生理作用（增强耐盐性）研究方面，关于枸杞甜菜碱的药理药效研究很少。[11-12]</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp;</span><span style=\"color:#E53333;\">枸杞色素</span></span><span style=\"color:#E53333;\">：枸杞色素是存在于枸杞浆果中的各类呈色物质，是枸杞籽的重要生理活性成分</span> \r\n	<div class=\"lemma-picture text-pic layout-right\" style=\"border:1px solid #E0E0E0;margin:0px 0px 3px;\">\r\n		<span style=\"line-height:1.5;color:#E53333;\">主要包括-胡萝卜素、叶黄素和其他有色物质。枸杞所含有的类胡萝卜素则具有非常重要的药用价值。很多研究已经证明枸杞籽色素具有提高人体免疫功能、预防和抑制肿瘤及预防动脉粥样硬化等作用。胡萝卜素是枸杞色素的主要活性成分，具有抗氧化和作为维生素A的合成前体等重要的生理功能。[13-14]</span> \r\n	</div>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">&nbsp; &nbsp; &nbsp;药理作用</span><span style=\"color:#E53333;\">：对免疫功能有影响作用。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp;</span><span style=\"color:#E53333;\">性味</span></span><span style=\"color:#E53333;\">：枸杞子：甘，平。枸杞叶：苦、甘；性凉。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">&nbsp; &nbsp; &nbsp;功能：</span><span style=\"color:#E53333;\">枸杞子：</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%85%BB%E8%82%9D\"><span style=\"color:#E53333;\">养肝</span></a><span style=\"color:#E53333;\">，滋肾，润肺。枸杞叶：补虚益精，清热明目。</span> \r\n</div>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/dongchongxiacao+ertongzhinengshoubiao/微信图片_20170414145219_2.jpg,/attached/image/dongchongxiacao+ertongzhinengshoubiao/青海黑枸杞_3.jpg,/attached/image/dongchongxiacao/14_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414142138_1.jpg,/attached/image/dongchongxiacao/微信图片_20170414142154_1.jpg', '76', '20', '100', '', '玉树野生虫草20条+诺木黑枸杞2000g（34000）', '青海20条+诺木黑枸杞2000g（34000）', '青海20条+诺木黑枸杞2000g（34000）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000178', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('97', '青海诺木洪野生黑枸杞150g', '快消商品/特产类', '1380.00', '1000.00', '1200.00', '/attached/image/20170506/3瓶  -1000_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-01 17:42:58', 'y', 'n', null, '3', '<p>\r\n	青海诺木洪野生黑枸杞\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;\">150g（礼盒装）</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\"><span style=\"color:#E53333;\">主要出产于</span><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:21px;background-color:#FFFFFF;\">青海、</span><span style=\"color:#E53333;\"></span><span style=\"color:#E53333;\">甘肃酒泉，新疆，内蒙，西藏等沙漠地带，海拔高气候干旱、生态环境洁净、无污染。经测定，</span></span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%BB%91%E6%9E%9C%E6%9E%B8%E6%9D%9E\"><span style=\"color:#E53333;\">黑果枸杞</span></a><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">含有17种氨基酸，13种微量元素，其中钙、镁、铜锌、铁的含量也高于红枸杞</span><span style=\"font-weight:700;color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">。</span><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">来自于青海柴达木盆地诺木洪核心产区，海拔3000米的盆地沙漠地带，海拔高、气候干旱、昼夜温差大、生态环境洁净、无污染。其当地0px－250px土层土壤含盐量可达8.9%，250px—750px土层土壤含盐量可达5.1%，可见黑枸杞耐盐碱能力特强，拥有着极强的生命力。由于其生长环境特殊、采摘难度大、采摘产量小、具有独特的功效和神奇的色香味，造就了黑枸杞这稀少珍贵的原生态滋补佳品。</span><span style=\"color:#E53333;\"></span> \r\n</p>', '15', '/attached/image/dongchongxiacao/013_3.jpg,/attached/image/dongchongxiacao/15_3.jpg,/attached/image/dongchongxiacao/20_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414154658_1.jpg,/attached/image/dongchongxiacao/微信图片_20170414154732_2.jpg', '76', '65', '100', '', '青海玉树虫草10g', '青海玉树虫草10g', '青海玉树虫草10g', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000179', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('98', '彩色能量石', '其他', '1680.00', '1000.00', '1200.00', '/attached/image/20170505/qwqwqwq_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 14:47:09', 'y', 'n', null, '2', '<p>\r\n	爆款彩色能量石抗疲劳，抗辐射，抗衰老\r\n</p>\r\n<p>\r\n	<span>1.促进血液循环- 将更完善的营养素和氧气输送至细胞内及从细胞内排除毒素，不再出现手脚冰冷的现象。 为血细球供应能量及减低黏性，能减低罹患心血管疾病、心脏病和中风的风险。 增加新陈代谢、促进排毒功能、保持身段苗条。 舒解身体各部位的酸痛、紧绷和僵硬。</span><br />\r\n<span>2.预防精神疲劳，保持宁心安神，改善睡眠品质。增进精神专注力，有助上班族在工作上取得更佳的表现；有助学生在考试时保持冷静，减少焦虑及在温习时增进注意力。使需长途或经常驾驶的人士感觉更精神，不会感到疲倦或打瞌睡。</span><br />\r\n<span>3.使身体恢复平衡及力气，并提升身体灵活性老年人行动更有力气和平衡，不会轻易摔倒受伤。运动员如高尔夫球员，能增强体魄、耐力与力气，呈现更好的表现。增强体能、保持青春，使身体更健康、更具活力。</span><br />\r\n<span>4.强化人体的生物能量场以抗防有害的电磁波。保护人体免受来自围绕着我们的计算机、手机、电器、电讯塔等的电磁波伤害，使身体恢复平衡与协调。</span> \r\n</p>', '7', '/attached/image/20170522/c彩色能量石001_3.jpg,/attached/image/20170522/c彩色能量石002_3.jpg,/attached/image/20170615/彩色能量石004_3.jpg', '74', '79', '100', '', '彩色能量石', '彩色能量石', '彩色能量石', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00018', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('101', '玉树虫草8条+诺木黑枸杞800g(12000)', '快消商品/特产类', '13800.00', '10000.00', '12000.00', '/attached/image/20170504/72_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-12 14:49:46', 'y', 'n', null, '2', '<p>\r\n	青海玉树野生虫草8条+诺木洪诺木黑枸杞800g(12000)\r\n</p>\r\n<p>\r\n	礼盒随机\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<h3 class=\"title-text\" style=\"font-size:18px;font-weight:400;\">\r\n	<span style=\"color:#E53333;\">保健作用</span> \r\n</h3>\r\n<h3 class=\"title-text\" style=\"font-size:18px;font-weight:400;\">\r\n	<span style=\"font-family:arial, 宋体, sans-serif;font-size:14px;line-height:1.5;font-weight:700;color:#E53333;\">抗衰老、改善睡眠：</span><span style=\"font-family:arial, 宋体, sans-serif;font-size:14px;line-height:1.5;color:#E53333;\">抗衰老是</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%BB%91%E6%9E%B8%E6%9D%9E\"><span style=\"color:#E53333;\">黑枸杞</span></a><span style=\"font-family:arial, 宋体, sans-serif;font-size:14px;line-height:1.5;color:#E53333;\">最主要的功效之一，大量的</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%8A%B1%E9%9D%92%E7%B4%A0\"><span style=\"color:#E53333;\">花青素</span></a><span style=\"font-family:arial, 宋体, sans-serif;font-size:14px;line-height:1.5;color:#E53333;\">能够很好的抗氧化，消除人体</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%87%AA%E7%94%B1%E5%9F%BA\"><span style=\"color:#E53333;\">自由基</span></a><span style=\"font-family:arial, 宋体, sans-serif;font-size:14px;line-height:1.5;color:#E53333;\">，具有显著的</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E6%8A%97%E8%A1%B0%E8%80%81\"><span style=\"color:#E53333;\">抗衰老</span></a><span style=\"font-family:arial, 宋体, sans-serif;font-size:14px;line-height:1.5;color:#E53333;\">的作用。花青素能穿越血脑屏障，可保护脑神经不被氧化，能稳定脑组织功能，保护大脑不受有害化学物质和毒素的伤害。食用黑枸杞中的花青素后，睡眠质量能得到显著提高。</span> \r\n</h3>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">美容养颜、改善皮肤：</span><span style=\"color:#E53333;\">可防止皮肤皱纹的提早生成，使肌肤更年轻、更有活力。它不但能防止皮肤皱纹的提早生成，更能补充营养及消除体内有害的自由基。花青素是天然的阳光遮盖物，能够阻止紫外线侵害皮肤，如果用花青素加以保护，则大约有 85% 的皮肤细胞可以幸免于难。</span> \r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">补肾益精、预防癌症：</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%BB%91%E6%9E%B8%E6%9D%9E\"><span style=\"color:#E53333;\">黑枸杞</span></a><span style=\"color:#E53333;\">同红枸杞一样能够补肾益精，黑枸杞中的花青素（Anthocyanosides）有清除自由基的功效，亦可让癌细胞无法顺利扩散，借此保护更多健康的细胞免于被癌细胞侵蚀。像是乳腺癌的致病机制便是如此，因此服用花青素对于乳腺癌的发展会有很好的抑制作用 。</span> \r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">护肝明目、增进视力：</span><span style=\"color:#E53333;\">医学临床报告显示蓝莓中的</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%8A%B1%E9%9D%92%E7%B4%A0\"><span style=\"color:#E53333;\">花青素</span></a><span style=\"color:#E53333;\">可促进视网膜细胞中</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%A7%86%E7%B4%AB%E8%B4%A8\"><span style=\"color:#E53333;\">视紫质</span></a><span style=\"color:#E53333;\">（Rho dopsin）的再生成，可预防重度近视及视网膜剥离，并可增进视力。</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%8A%B1%E8%89%B2%E7%B4%A0\"><span style=\"color:#E53333;\">花色素</span></a><span style=\"color:#E53333;\">可以提高在昏暗灯光下的视力，这对于夜间驾车者，长时间注视屏幕的人等都有帮助。</span> \r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">改善循环、增强体质：</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E8%8A%B1%E9%9D%92%E7%B4%A0\"><span style=\"color:#E53333;\">花青素</span></a><span style=\"color:#E53333;\">能够改善血液循环，恢复失去的微血管功效，加强脆弱的血管，因而是血管更具弹性。原花青素被称为“动脉粥样硬化的解毒药”。对于静脉功能不足者，原花青素能有效地减轻疼痛、浮肿、夜间痉挛等症状所以欧洲的医生通常会建议静脉曲张的病人食用富含花青素食品。</span> \r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;color:#E53333;\">防治糖尿病：</span><span style=\"color:#E53333;\">黑果枸杞还可防治</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E7%B3%96%E5%B0%BF%E7%97%85\"><span style=\"color:#E53333;\">糖尿病</span></a><span style=\"color:#E53333;\">，并具有明显的抗疲劳，保肝，还能抗肿瘤，疏通血管，降压，保护</span><a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%BF%83%E8%A1%80%E7%AE%A1%E7%B3%BB%E7%BB%9F\"><span style=\"color:#E53333;\">心血管系统</span></a><span style=\"color:#E53333;\">作用。</span> \r\n</div>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/dongchongxiacao+ertongzhinengshoubiao/微信图片_20170414144855_1.jpg,/attached/image/dongchongxiacao+ertongzhinengshoubiao/青海黑枸杞7_3.jpg,/attached/image/dongchongxiacao/05_3.jpg,/attached/image/dongchongxiacao/14_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414142154_3.jpg', '76', '7', '100', '', '玉树虫草8条+诺木黑枸杞800g(12000)', '玉树虫草8条+诺木黑枸杞800g(12000)', '玉树虫草8条+诺木黑枸杞800g(12000)', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000182', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('102', '青海玉树野生虫草（5800）', '快消商品/特产类', '6670.00', '5000.00', '5800.00', '/attached/image/20170613/虫草001_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-14 12:04:35', 'y', 'n', null, '2', '<p>\r\n	青海玉树野生虫草（5800）\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;\">8支*0.25（礼盒随机）</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;\">冬虫夏草又名虫草，是我国民间惯用的一种名贵滋补药材，其营养成分高于人参，可入药，也可食用，是上乘的佳肴，具有很高的营养价值。冬虫夏草可以增强机体的免疫力，滋补肺肾，对肺癌、肝癌等有明显的抑制作用。在临床上对肺虚久咳，气喘，肺结核咯血，盗汗，肾虚腰膝酸痛，阳痿遗精，神经衰弱及化疗、放疗后的红细胞下降都有疗效。</span><span style=\"color:#E53333;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;\"><img src=\"/mnt/data/img/attached/image/20170614/虫草010_3.jpg\" width=\"360\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;\"><img src=\"/mnt/data/img/attached/image/20170613/虫草009_3.jpg\" width=\"360\" alt=\"\" /><br />\r\n</span> \r\n</p>', '15', '/attached/image/20170613/虫草003_3.jpg,/attached/image/20170613/虫草004_3.jpg,/attached/image/20170613/虫草005_3.jpg,/attached/image/20170613/虫草006_3.jpg,/attached/image/20170613/虫草007_3.jpg,/attached/image/20170613/虫草008_3.jpg', '76', '0', '100', '', '青海玉树野生虫草（5800）', '青海玉树野生虫草（5800）', '青海玉树野生虫草（5800）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000183', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('103', '青海玉树野生虫草3（23000）', '快消商品/特产类', '26450.00', '20000.00', '23000.00', '/attached/image/20170504/74_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-12 14:57:33', 'y', 'n', null, '2', '<p>\r\n	青海玉树野生虫草3（23000）\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">36支*0.25g（礼盒随机）</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草具有多种药理作用，现总结归纳如下：</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;1对循环系统的作用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;(1)对心脏的作用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草有负性频率、降低心肌耗氧量、改善心肌缺血、抗血小板聚集和抗心律失常等作用。虫草醇提取物对急性病毒性心肌炎有明显保护作用。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;(2)对血液系统的作用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草对血小板减少及血小板超微结构的损伤均有明显的保护作用，对戊巴比妥钠麻醉有明显的降压作用。虫草水提液具有较强的扩张冠状动脉并增加冠脉流量的功能。虫草提取物能促进血小板凝集而起到止血作用，其醇提取液能抑制血栓形成。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;2对呼吸系统的作用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">冬虫夏草可明显增强肾上腺素的扩张支气管作用，调节支气管平滑肌，减轻老年慢性支气管炎、哮喘、肺气肿、肺心病等症状，延缓复发时间。同时虫草素对结核杆菌等引起肺部感染的病菌有强烈抑制和杀灭作用，且虫草酸和虫草多糖能修复已受损的肺泡细胞。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;3对免疫系统的作用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">包括以下几个方面：</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(1)对体液免疫功能有增强或减弱的双向调节作用；</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(2)可增强巨噬细胞吞噬功能，提高机体免疫功能；</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(3)通过促进脾脏DNA的生物合成，增加核酸和蛋白质的含量，促进脾淋巴细胞的增殖而影响免疫器官的重量；</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(4)使自然杀伤细胞的活性增强，从而在抗癌、抗病毒感染中起重要作用。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">&nbsp; &nbsp; &nbsp;&nbsp;4对消化系统的作用</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">肝脏是人体消化系统中一个重要的消化腺分泌器官，对造血、解毒、脂肪的转化等都起到极其重要的作用，冬虫夏草对消化系统的作用就主要表现在对肝脏的一系列保护和防治上。</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(1)冬虫夏草可改善患者肝功能，减轻肝脏的炎性细胞浸润和肝细胞变性坏死，虫草菌丝有较强的促肝细胞修复作用；</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(2)虫草多糖脂质体(CPL)对CCl4损伤的肝组织有一定的保护作用；</span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;font-family:\'Microsoft YaHei\';\">(3)冬虫夏草水溶液能抑制肝储脂细胞增殖，还能抑制肝储脂细胞向肌纤维细胞及成纤维细胞转化。</span> \r\n</div>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/dongchongxiacao/011_3.jpg,/attached/image/dongchongxiacao/02_3.jpg,/attached/image/dongchongxiacao/14_3.jpg,/attached/image/dongchongxiacao/4_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414142138_1.jpg,/attached/image/dongchongxiacao/微信图片_20170414142154_3.jpg', '76', '15', '100', '', '青海玉树野生虫草3（23000）', '青海玉树野生虫草3（23000）', '青海玉树野生虫草3（23000）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000184', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('104', '鼎烨定制炒菜机', '电子商品/生活电子商品', '2480.00', '1000.00', '1880.00', '/attached/image/20170615/炒菜机003-返利_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 14:41:31', 'y', 'n', null, '2', '鼎烨定制炒菜机\r\n<p class=\"MsoNormal\">\r\n	电压：220V\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	功率：1700W（上部400W/下部1300W）/2000W（上部400W/下部1600W）\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	配锅：炒菜锅/平底锅\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	功能：炒菜、煎烤、油炸、煮、焖、炖、煲\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	控制面板：触摸按键、LCD屏显示\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<img src=\"/mnt/data/img/attached/image/20170615/炒菜机006_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170615/炒菜机007_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170615/炒菜机008_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170615/炒菜机009_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170615/炒菜机010_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>', '7天', '/attached/image/20170512/微信图片_20170512102001_1.jpg,/attached/image/20170512/微信图片_20170512102033_2.jpg,/attached/image/20170512/微信图片_20170512102038_2.jpg,/attached/image/20170512/微信图片_20170512102042_1.jpg,/attached/image/20170615/炒菜机004_3.jpg,/attached/image/20170615/炒菜机005_3.jpg', '67', '41', '100', '', '鼎烨定制炒菜机', '鼎烨定制炒菜机', '鼎烨定制炒菜机', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000185', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('105', '大连特产淡干野生海参', '快消商品/特产类', '12650.00', '10000.00', '11000.00', '/attached/image/20170612/大连海参001_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-12 17:36:39', 'y', 'n', null, '2', '鼎烨7A淡干野生海参<br />\r\n规格：7-13只&nbsp;<br />\r\n保质期：720天<br />\r\n级别：7A &nbsp; 7A级海参为7年海参<br />\r\n干参长度：4-6厘米<br />\r\n泡发后长度：8-14厘米<br />\r\n功效：根据本草纲目记载，野生海参，具有，补肾益精，养血易髓，壮阳疗痿，降火通常，调经养胎，抗衰驻颜，平心悸，等功效。与，燕窝，鱼翅齐名，是八大营养珍品之一。号称海洋伟哥，也是抗癌灵丹其含有丰富的铁及海参胶原蛋白足可起到固本培元。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;发制方法 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 一、浸泡:将海参表面清洗干净后，浸泡在洁净无油的装有适量的纯净水的容器内(水要没过海参)泡发约24小时左右，期间换水3-4次直至海参体变软(此步骤的目的是把海参浸泡至柔软可以清洗内部的状态)。最好用纯净水(勿用自来水)，这样才能保证最终泡出来的海参个大、肉质鲜美 、营养更易吸收。<br />\r\n<br />\r\n二、清洗:沿着腹部的刀口把海参从头部至尾部剪开，剪掉头部的沙嘴和抠除海参牙(白色的硬状物)，清洗海参体内杂质和内脏，挑断海参内壁上附着的筋。 去掉内筋和肠子海参发泡的个儿会更大。海参内白筋和肠子营养丰富洗净可做汤用。<br />\r\n<br />\r\n三、锅煮:将洗净后的海参放入洁净无油的锅里加入适量纯净水，中火烧开后再小火煮30-40分钟，熄火后不要开盖，把海参留在锅里焖至自然凉透，捡出煮软的海参，将硬的或者仍有硬芯的海参留在锅中，换纯净水继续煮，直至全部煮软煮透。(此步骤的目的就是要把海参彻底煮软煮透，部分发制者喜欢煮两遍效果是一样的)。<br />\r\n<br />\r\n四、浸泡:洁净无油的容器内盛满纯净水，放入煮好的海参。然后置于电冰箱的保鲜室内，再浸泡约24-48小时，其间换水3-4次，即可食用。<br />\r\n<br />\r\n五、发制好的海参要浸泡在纯净水中并经常换水，海参应尽快食用，不可长时间浸泡或长时间带水放置在冰箱保鲜室内。<br />\r\n<br />\r\n<p>\r\n	六、如一次发制较多，不能够立刻吃完，应以保鲜袋单个盛装后放置在冰箱的冷冻室内冷冻保存，需要时用热水浸泡即可食用。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/大连海参005_3.jpg\" width=\"360\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170612/大连海参002_3.jpg,/attached/image/20170612/大连海参003_3.jpg,/attached/image/20170612/大连海参004_3.jpg,/attached/image/20170612/大连海参005_3.jpg,/attached/image/20170612/大连海参006_3.jpg,/attached/image/20170612/大连海参007_3.jpg', '76', '0', '100', '', '大连特产淡干野生海参', '大连特产淡干野生海参', '大连特产淡干野生海参', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000186', '', null, null, null, '38', null);
