INSERT INTO `t_product_kd` VALUES ('109', '北欧风情四件套', '快消商品/生活用品类', '2800.00', '2100.00', '2680.00', '/attached/image/20170513/四件套花色标注返利2100_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 23:21:43', 'y', 'n', null, '3', '<p>\r\n	<span style=\"font-size:14px;\">北欧风情四件套，</span><span style=\"font-size:14px;color:#EE33EE;\"><span style=\"color:#EE33EE;\">下单请备注花色</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">专版60长绒棉印花系列—</span><span style=\"font-size:14px;\">—风尚</span><br />\r\n<span style=\"font-size:14px;\">极致的质感，比普通全棉更柔软</span><br />\r\n<span style=\"font-size:14px;\">面料蓬松度比普通全棉提升10.8%，</span><br />\r\n<span style=\"font-size:14px;\">菱形蜂窝蓄热结构，持久恒温</span><br />\r\n<span style=\"font-size:14px;\">独特大气专版花型，</span><br />\r\n<span style=\"font-size:14px;\">产品特性：</span><br />\r\n<span style=\"font-size:14px;\">️天然纤维，100%全棉</span><br />\r\n<span style=\"font-size:14px;\">️亲肤触感，加倍温暖</span><br />\r\n<span style=\"font-size:14px;\">️吸湿透气，舒适安睡</span><br />\r\n<span style=\"font-size:14px;\">4 高支高密，紧密厚实</span><br />\r\n<span style=\"font-size:14px;\">工艺：</span><br />\r\n<span style=\"font-size:14px;\">1 &nbsp;枕套采用纽扣设计，简单低调</span><br />\r\n<span style=\"font-size:14px;\">2 &nbsp;床单采用床头7公分贴边工艺</span><br />\r\n<span style=\"font-size:14px;\">3 被套纽扣式封口 设计</span><br />\r\n<span style=\"font-size:14px;\">规格：</span><br />\r\n<span style=\"font-size:14px;\">标准：被套200*230 床单245*250 枕套48*74 &nbsp; &nbsp;&nbsp;</span><br />\r\n<span style=\"font-size:14px;\">加大：被套220*240 床单245*270 枕套48*74</span> \r\n</p>\r\n<div>\r\n	<br />\r\n</div>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170513/SJTHS01_3.jpg,/attached/image/20170513/SJTHS02_3.jpg,/attached/image/20170513/SJTHS03_3.jpg', '70', '0', '100', '', '北欧风情四件套', '北欧风情四件套（重销商城）', '北欧风情四件套（重销商城）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000190', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('110', '西凤酒', '快消商品/酒类', '5175.00', '4000.00', '4600.00', '/attached/image/20170504/78_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 23:21:43', 'y', 'n', null, '3', '西凤酒*2瓶/提', '15', '/attached/image/shanxixifengjiu/3_3.png,/attached/image/shanxixifengjiu/图片1_3.png,/attached/image/shanxixifengjiu/图片3_3.png,/attached/image/shanxixifengjiu/图片5_3.png,/attached/image/shanxixifengjiu/图片6_3.png', '71', '10', '100', '', '西凤酒', '西凤酒', '西凤酒', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000191', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('111', '青海诺木洪野生黑枸杞700g', '快消商品/特产类', '5880.00', '5000.00', '5720.00', '/attached/image/20170505/lllll_3.jpg', '2017-04-28 14:16:52', '', '13144880566', '2017-05-09 14:15:14', 'y', 'n', null, '2', '<p>\r\n	青海诺木洪野生黑枸杞\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;\">700g（礼盒随机）</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\"> </span> \r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp; 黑枸杞是生长于青海格尔木大草原上的野生植物，对于草原来说，是防风固沙的重要植被。但从2015年8月10日至今，有超过5000人涌入洗劫了草原上超过300万亩草场，目的就是为了采摘这种豆粒般大的紫黑色浆果，而逐利成为最大的动机。</span> \r\n</div>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp; 报道称，黑枸杞被称为“软黄金”，近年来产地价格涨了近8倍，增长到近500元每公斤。在格尔木一个叫“金三角”的地方是黑枸杞交易市场，在一个特产店里，黑枸杞零售分为四等，每公斤最低的1200元，最高的4400元。记者在某大型网络购物平台上搜索发现，两三千元一斤的“野生黑枸杞”干果比比皆是，最贵的“特级产品”卖到4000多元一斤。</span> \r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"color:#E53333;\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">黑枸杞呈深黑色，干果易碎，内含5-12粒果籽，颗粒大的则有更多的籽，多则达30颗籽以上，像红枸杞的籽一样，黑枸杞泡水颜色很深，含糖量低，水微微甜，甚至感觉不到甜，如果干果泡水甜味甚重，则该黑枸杞经过冰糖水处理过，这种黑枸杞外表颜色特别艳丽；白刺果呈暗红色，没有果柄，果实成熟果柄自动脱落，独核(其最大特点)，用手捏很硬，白刺果泡水颜色很淡，含糖量较高，口感偏甜。</span> \r\n</p>\r\n<span style=\"color:#E53333;\"> &nbsp; &nbsp; &nbsp;</span><span style=\"color:#E53333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">成年人每天吃20克左右的枸杞比较合适，也可以根据自己服用状况增减数量，达到效果最佳为止；既可以放在嘴中嚼着吃，也可泡水喝。一定要长期坚持，每天吃一点，才能见效。</span><span style=\"line-height:1.5;color:#E53333;\"></span> \r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/dongchongxiacao+ertongzhinengshoubiao/微信图片_20170414145219_3.jpg,/attached/image/dongchongxiacao/013_3.jpg,/attached/image/dongchongxiacao/20_3.jpg,/attached/image/dongchongxiacao/微信图片_20170414154658_1.jpg,/attached/image/dongchongxiacao/微信图片_20170414154732_1.jpg,/attached/image/dongchongxiacao/微信图片_20170414154739_1.jpg', '76', '89', '300', '', '青海诺木洪野生黑枸杞700g', '青海黑枸杞700g', '青海黑枸杞700g', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000192', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('112', '台湾希面膜', '快消商品/化妆品', '1350.00', '1000.00', '1200.00', '/attached/image/20170505/wew321321_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 23:21:43', 'y', 'n', null, '3', '台湾希面膜*3盒', '15', '/attached/image/mianmo/1_3.gif,/attached/image/mianmo/2_3.gif,/attached/image/mianmo/3_3.gif', '77', '57', '100', '', '台湾希面膜*3盒', '台湾希面膜', '台湾希面膜', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000193', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('113', '长白山林人参礼盒', '快消商品/特产类', '6350.00', '5000.00', '5800.00', '/attached/image/20170504/81_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 23:21:43', 'y', 'n', null, '3', '<p>\r\n	长白山林人参礼盒\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>单位：</span>2<span>支</span><span>/</span><span>盒</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0000pt;\">\r\n	产品描述及功效：人参是非常名贵的滋补品，是东北特产之一，因其产量稀少而滋补效果显著，具有补五脏，安精神，男女一切虚症，肢冷脉微，术后复原，具有补气强身，延缓衰老之功效！\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0000pt;\">\r\n	适用人群：久病体弱及身体虚寒，活动后心慌气短，血压偏低，妇女产后体虚，老年性体虚无力，贫血等！青年人服用人参精力更旺盛！\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	食用方法：可炖鸡汤及排骨汤等（人参味浓，可用半支参）\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/rencan/2_3.jpg,/attached/image/rencan/3_3.jpg,/attached/image/rencan/6_3.jpg,/attached/image/rencan/7_3.jpg,/attached/image/rencan/8_3.jpg', '76', '6', '100', '', '长白山林人参礼盒', '长白山林人参礼盒', '长白山林人参礼盒', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000194', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('114', '绿叶爱生活', '快消商品/生活用品类', '1350.00', '1000.00', '1200.00', '/attached/image/20170511/82_3_2.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-10 11:55:02', 'y', 'n', null, '3', '<p>\r\n	绿叶爱生活 &nbsp;规格：20包\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">食品级优质铝箔外包装，并有易拉贴封口，防潮 防菌 防霉</span> \r\n</div>\r\n<div style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">&nbsp; &nbsp;*卫生巾表面采用柔肤丝绵，超薄 柔软 舒适 立体网面，与人体表面接触面小 。</span> \r\n</div>\r\n<div style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp; &nbsp;<span style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:21px;background-color:#FFFFFF;\">*</span>德国进口超强高分子强力锁水因子，吸水力超强，是普通卫生巾的3—5倍，能把涌入的液体凝结 &nbsp; &nbsp; &nbsp; &nbsp;成啫喱状，保持表面干爽。\r\n</div>\r\n<div style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">&nbsp; &nbsp; *舒爽透气底膜，具有强透气性，会呼吸，有效防止细菌滋生。</span> \r\n</div>\r\n<div style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp; &nbsp;&nbsp;<span style=\"line-height:1.5;\">*负离子芯片能释放出的负离子能促进体内生化酶转化并与异味气体分子中和，从而达到提高人体自洁能力，祛除异味的作用，有效抑菌。</span> \r\n</div>\r\n<p style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp; &nbsp;&nbsp;<span style=\"line-height:1.5;\">*首创双芯技术，将活氧与负离子有机结合，能有效提高体内含氧量，在抑制有害细菌滋生的同时保护有益菌，可以有效保持女性生理的自洁能力；纯物理效应、不含任何药物或化学成份，无副作用；让女性持续拥有健康、舒适、清洁的生理环境。</span> \r\n</p>\r\n<p style=\"font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"line-height:1.5;\"><img src=\"/mnt/data/img/attached/image/20170603/绿叶卫生巾001_3.jpg\" width=\"400\" alt=\"\" /><br />\r\n</span></strong> \r\n</p>\r\n<strong><br />\r\n</strong> \r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/weishengjin/1_3.jpg,/attached/image/weishengjin/2_3.jpg,/attached/image/weishengjin/5_3.jpg,/attached/image/weishengjin/6_3.jpg,/attached/image/weishengjin/7_3.jpg', '70', '87', '100', '', '绿叶爱生活', '绿叶爱生活', '绿叶爱生活', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000195', '', null, null, null, '38', null);
