INSERT INTO `t_product_kd` VALUES ('138', '赤壁青砖茶', '快消商品/茶类', '1380.00', '1000.00', '1200.00', '/attached/image/20170526/赤壁青砖茶006_3.jpg', '2017-04-28 14:16:52', '', '15827476130', '2017-05-26 17:57:41', 'y', 'n', null, '2', '<p class=\"MsoNormal\">\r\n	茶叶：赤壁青砖茶\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>规格：</span>1600g\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	种类：青砖茶\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>保质期：可长期</span> <span>存放，越陈越香</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>储存方法：清洁、干燥、无异味</span> <span>通风处保存，品质更佳！</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	赤壁青砖茶以传统青砖压制工艺，适合煮饮、冲泡（煮饮口感更佳），汤色橙红透亮，醇厚爽\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	说明：羊楼洞青砖茶经长时间独特发酵后高温压制而成，不含任何添加剂！茶汤浓香可口，具有清心提神，生津止渴，暖人御寒，化滞利胃，杀菌收敛，治疗腹泻等多种功效，陈砖茶效果更好。具有降三高，利尿解毒，抗氧化，抗癌，抗辐射等功效\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<img src=\"/mnt/data/img/attached/image/20170526/赤壁青砖茶005_3.jpg\" width=\"380\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170526/赤壁青砖茶001_3.jpg,/attached/image/20170526/赤壁青砖茶002_3.jpg,/attached/image/20170526/赤壁青砖茶004_3.jpg', '84', '75', '100', '', '赤壁青砖茶', '赤壁青砖茶', '赤壁青砖茶', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00034', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('140', '人参综合发酵原液', '快消商品/食品类', '1380.00', '1000.00', '1200.00', '/attached/image/20170505/fff3333_3.jpg', '2017-04-28 14:16:52', '', '15827476130', '2017-06-03 12:00:53', 'y', 'n', null, '3', '<p>\r\n	人参综合发酵原液\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\">\r\n	<span>人参具有大补元气、复脉固脱、补脾益肺、生津、安神等功效。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1<span>．</span><span>人参可全面增强机体的免疫功能</span>的作用。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>．人参有强心和抗心肌缺血作用。</span><span>对血管、血压的影响人参对整体动物的冠状动脉、脑血管、椎动脉、肺动脉均有扩张作用，改善这些器官的血循环。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	3<span>．</span><span>人参提取物、人参皂甙和人参多糖均有抗实验性肿瘤的作用。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4<span>．</span><span>人参对注射肾上腺素和高渗葡萄糖引起的高血糖有降糖作用。另外，人参也可升高注射胰岛素而降低的血糖，表明其对糖代谢有双向调节作用。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170603/人参综合发酵原液_3.jpg', '85', '57', '100', '', '人参综合发酵原液', '人参综合发酵原液', '人参综合发酵原液', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00036', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('141', '高级普洱茶', '快消商品/茶类', '12000.00', '10000.00', '11000.00', '/attached/image/20170608/普洱茶001-10000_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-08 10:39:15', 'y', 'n', null, '3', '<p>\r\n	高级普洱茶 &nbsp;&nbsp;<span style=\"line-height:1.5;\">357g/饼X7</span>\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170606/普洱茶003_3.jpg\" width=\"400\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	降脂、减肥、降压、抗动脉硬化都是普洱茶作用。长期饮用普洱茶能使胆固醇及甘油脂减少，所以饮用普洱茶有减肥的效果。普洱茶作用还能使人的血管舒张、血压下降、心率减慢和脑部血流量减少等，所以对高血压和脑动脉硬化患者有良好治疗作用。<br />\r\n防癌、抗癌。养胃、护胃也是普洱茶作用中的一种。在适宜的浓度下，饮用平和的普洱茶对肠胃不产生刺激作用，粘稠、甘滑、醇厚的普洱茶进入人体肠胃形成的膜附着于胃的表层，对胃产生有益的保护层，长期饮用普洱茶可起到养胃、护胃作用。<br />\r\n<br />\r\n健牙护齿。普洱茶中含有许多生理活性成分，具有杀菌消毒的作用。<br />\r\n<br />\r\n消炎、杀菌、治痢。医药界研究及临床实验证明普洱茶作用，云南普洱茶有抑菌作用，浓茶汁日服十次，可以治疗细菌性痢疾，这与云南大叶种茶内含丰富的茶多酚直接相关。<br />\r\n抗衰老是普洱茶作用之最。茶叶中儿茶素类化含物具有抗衰老的作用，云南大叶种茶所含儿茶素，总量高于其他茶树品种，抗衰老作用优于其他茶类。同时，普洱茶在加工过程中，大分子多糖类物质转化成了大量新的可溶性单糖和寡糖，维生素C成倍增加，这些物质对提高人体免疫系统的功能发挥着重要作用，起到了养生健体、延年益寿的功效。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170608/普洱茶002_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/普洱茶003_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/普洱茶004_3.jpg\" width=\"400\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170606/普洱茶002_3.jpg', '84', '0', '100', '', '高级普洱茶', '高级普洱茶', '高级普洱茶', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00037', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('142', '名家铁壶', '快消商品/茶类', '5900.00', '4000.00', '4700.00', '/attached/image/20170504/98_3.jpg', '2017-04-28 14:16:52', '', '15827476130', '2017-06-03 13:56:09', 'y', 'n', null, '2', '<p>\r\n	名家铁壶\r\n</p>\r\n<p>\r\n	铁铸茶壶起源于我国，后流传并盛行于至日本，一直被视为提升茶品品感标准的必备器具。铁壶集实用、保健、美观、艺术价值于一体，实为众多茶叶爱好者争相收藏的茶道精品。<br />\r\n<br />\r\n铁壶的主要优点：<br />\r\n&nbsp; &nbsp; 一、煮茶利器：铁壶烧水沸点温度更高，比一般不锈钢随手泡等要高出2-3度，且保温时间也更长，利用高温水泡茶，可激发和提升茶的香气。而尤其对于普洱老茶而言，因陈化时间较长，是必须采用足够的高温水，才能淋漓尽致把其内质陈香和茶韵发挥出来，实为绝配，已越来越多的成为玩家级普洱茶友们赏茶、斗茶、鉴茶以及开展茶会活动必备的专业茶器。<br />\r\n&nbsp; &nbsp; 二、改善水质：使水更软滑、甘甜，能有效改善和提高泡茶的口感，令您的好茶锦上添花。<br />\r\n&nbsp; &nbsp; 三、补铁保健：成人每日需0.8-1.5毫克的铁，铁壶煮水能释出易于人体吸收的铁离子，补充人体所需.<br />\r\n&nbsp; &nbsp; 四、赏玩收藏：铁壶不仅是茶具，上等的铸铁壶更是具有艺术价值的收藏品，具有升值潜力。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; 用铁壶煮茶的方法：<br />\r\n&nbsp; &nbsp; 【适宜茶品】级别较粗老的熟茶或老茶<br />\r\n&nbsp; &nbsp; 【适用场合】居家、茶店、茶艺馆<br />\r\n&nbsp; &nbsp; 【操作流程】铁壶煮茶可以有三种不同的流程：先泡后煮；热水煮；冷水煮。<br />\r\n&nbsp; &nbsp; 【注意事项】<br />\r\n&nbsp; &nbsp; 一、铁壶第一次使用，先将一小杯茶叶用布包好放入铁壶内加水蒸煮约10分钟（另外也可用柠檬片直接放入铁壶内去除异味）。<br />\r\n<br />\r\n&nbsp; 如此茶叶中所含的丹宁和铁壶中溶解出的铁份,会在铁壶表面形成一层丹宁铁的皮膜,将更不容意生绣。烧开后将壶内水倒掉，重复2-3次，直至水质透明即可。建议新壶刚开始使用时请每天使用，让水垢能迅速付附着，防止铁壶生锈。 &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp; &nbsp; 二、煮水泡茶时，注入的水量以不超过壶容量的8成（80%）为宜，以防沸水溅；<br />\r\n&nbsp; &nbsp; 三、壶提梁是隔热的，但壶盖温度高，倾倒烧开的茶水时，应以茶巾折叠垫手摁住壶盖，以防烫手；<br />\r\n&nbsp; &nbsp; 四、煮沸后及时移出炉灶，放置在壶垫上，防止喷溅或者烫伤茶桌台面；<br />\r\n&nbsp; &nbsp; 五、此壶全生铁铸造，底部平整，可以使用煤气、电炉、电磁炉、木炭炉加热，禁止使用微波炉加热；<br />\r\n&nbsp; &nbsp; 六、每次使用完毕，一定要将水和茶叶清掉，并用软干布将铁壶内外擦干，而滤网则可用软刷清洗干净，在清洗时只可使用清水，切勿使用清洁剂，同时，忌使用尖、硬、金属器物刷擦涂层表面；避免用手直接触碰铁壶内部。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp;七、铁壶泡茶时，绿茶、花茶及普洱新茶，水温为70-80度为宜（必须是沸水降至此温度），普洱老茶则可尽量以高温冲泡。<br />\r\n</p>', '15', '/attached/image/20170510/13_3.jpg,/attached/image/20170510/15_3.jpg,/attached/image/20170510/16_3.jpg,/attached/image/20170510/17_3.jpg,/attached/image/20170510/18_3.jpg', '84', '37', '100', '', '名家铁壶', '名家铁壶', '名家铁壶', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00038', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('143', '顶级化妆套盒', '快消商品/化妆品', '1380.00', '1000.00', '1200.00', '/attached/image/20170504/99_3.jpg', '2017-04-28 14:16:52', '', '15827476130', '2017-06-03 16:40:00', 'y', 'n', null, '3', '<p>\r\n	顶级化妆套盒\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170603/顶级化妆套盒-001_3.jpg\" width=\"400\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170510/img1_3.jpg,/attached/image/20170510/img3_3.jpg,/attached/image/20170510/img4_3.jpg,/attached/image/20170510/img6_3.jpg,/attached/image/20170510/img_3.jpg', '77', '42', '100', '', '顶级化妆套盒', '顶级化妆套盒', '顶级化妆套盒', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00039', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('144', '野生黑枸杞', '快消商品/特产类', '6670.00', '5000.00', '5800.00', '/attached/image/20170504/100_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 23:24:24', 'y', 'n', null, '3', '<p class=\"MsoNormal\" align=\"justify\" style=\"text-align:justify;\">\r\n	［黑枸杞的功效与作用］：\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.滋补肝肾\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;黑果枸杞能滋补肝肾、益精明目、适用于腰膝酸软、头晕目眩、两眼昏花等症状，藏医药经典《四部医典》、《晶珠本草》等记载黑果枸杞主治心热病、心脏病、月经不调、停经等。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.延缓衰老\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;黑枸杞富含花青素，具有抗氧化作用，可防止过早衰老，增强血管弹性，抑制过敏及炎症，改善关节柔韧性。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.<span>黑果枸杞的含油率为</span>5.54﹪，主要脂肪酸有3种，以不饱和脂肪酸为主。其中亚油酸含量最高，为71.48﹪。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.黑枸杞最突出的成分为花青素，花青素是一种强效的抗氧化剂，可防止过早衰老，增强血管弹性。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>［适合人群］</span>:所有人\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>［规格］</span>:500g\r\n</p>\r\n<u></u>', '15', '/attached/image/20170510/野生黑枸杞-02_3.gif,/attached/image/20170510/野生黑枸杞-08_3.gif,/attached/image/20170510/野生黑枸杞-10_3.gif,/attached/image/20170510/野生黑枸杞-13_3.gif,/attached/image/20170510/野生黑枸杞_01_2.gif', '76', '15', '100', '', '野生黑枸杞', '野生黑枸杞', '野生黑枸杞', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00040', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('145', '沙鸥核桃油', '快消商品/生活用品类', '1380.00', '1000.00', '1200.00', '/attached/image/20170504/101_3.jpg', '2017-04-28 14:16:52', '', null, '2017-06-13 15:27:18', 'y', 'n', null, '2', '沙鸥核桃油\r\n<p class=\"MsoNormal\">\r\n	500ML/<span>瓶</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span><img src=\"/mnt/data/img/attached/image/20170603/沙鸥核桃油001_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170603/沙鸥核桃油003_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170603/沙鸥核桃油002_3.jpg\" width=\"400\" alt=\"\" /><br />\r\n</span>\r\n</p>', '15', '/attached/image/you/2_3.jpg,/attached/image/you/4_3.jpg,/attached/image/you/5_3.jpg,/attached/image/you/7_3.jpg,', '70', '0', '0', '', '沙鸥核桃油', '沙鸥核桃油', '沙鸥核桃油', null, 'item', '0', 'n', null, null, null, 'n', '', 'A00041', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('146', '龙泉青瓷茶具', '快消商品/茶类', '1380.00', '1000.00', '1200.00', '/attached/image/20170508/龙泉茶具_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-19 23:24:24', 'y', 'n', null, '3', '龙泉青瓷茶具', '15', '/attached/image/1200dingjianchaju/微信图片_20170318132745_2.jpg,/attached/image/1200dingjianchaju/微信图片_20170318132814_1.jpg,/attached/image/1200dingjianchaju/微信图片_20170318132820_1.jpg,/attached/image/1200dingjianchaju/微信图片_20170318132820_2.jpg,/attached/image/1200dingjianchaju/微信图片_20170318132824_1.jpg', '84', '77', '100', '', '龙泉青瓷茶具', '龙泉青瓷茶具', '龙泉青瓷茶具', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00042', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('147', '蓝莓发酵原液', '快消商品/食品类', '1380.00', '1000.00', '1200.00', '/attached/image/20170504/103_3.jpg', '2017-04-28 14:16:52', '', '15827476130', '2017-06-03 16:37:44', 'y', 'n', null, '3', '<p>\r\n	蓝莓发酵原液\r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">蓝莓的花青素含量排名第一。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\">\r\n	<span>花青素是纯天然的抗衰老的营养补充剂，研究证明是当今人类发现最有效的抗氧化剂，它的抗氧化性能比维生素</span>E高出五十倍，比维生素C高出二百倍，<span>是目前自然界最有效的抗氧化物质。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1.增进视力 &nbsp;2.<b>&nbsp;</b><span>美容</span> &nbsp;3. 改善睡眠\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4.<b>&nbsp;</b><span>加固血管、改善循环</span> &nbsp;5.<b>&nbsp;</b><span>预防肿瘤</span> &nbsp;6. 增强记忆力\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170523/蓝莓发酵原液001_3.jpg,/attached/image/20170523/蓝莓发酵原液002_3.jpg,/attached/image/20170603/蓝莓发酵原液_3.jpg', '85', '52', '100', '', '蓝莓发酵原液', '蓝莓发酵原液', '蓝莓发酵原液', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00043', '', null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('148', '养生足弓器', '快消商品/生活用品类', '1325.00', '1000.00', '1200.00', '/attached/image/20170504/104_3.jpg', '2017-04-28 14:16:52', '', '15827476130', '2017-06-03 11:29:40', 'y', 'n', null, '2', '<div style=\"margin:0px auto;padding:0px;color:#666666;font-family:Arial, 宋体B8B体;background-color:#FFFFFF;\">\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">1.调整足弓: (促进骨架平衡) 。</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">2.调理神经系统:改善脊椎不整，调理神经传导 。</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">3.足底按摩:能量按摩涌泉穴(贤脏)与脏腑反射区、促进足底六条经络(</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">肝.脾.肾.胃. 胆.膀胱) 之循环代谢 。</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">4.纳米远红外线光波能量功效:促进血液循环、活化细胞。(能量共振-效</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">果神奇)&nbsp;</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">5.养生芯片:调理内分泌整体的平衡增强免疫力。</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">6.纳米负离子效应:高单位的负离子,可有效的舒缓压力，恢复体力，排</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">除疲劳。&nbsp;</span> \r\n	</div>\r\n	<div style=\"padding:0px;margin:0px auto;font-family:Arial, Tahoma, 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';line-height:2;color:#000000;\">7.杀菌功能:对金黄色葡萄球，大肠杆菌，霉菌有杀菌、除臭功能。</span> \r\n	</div>\r\n<br />\r\n</div>\r\n<div>\r\n	<br />\r\n</div>', '15', '/attached/image/jiaotie/1_副本_1.jpg,/attached/image/jiaotie/3_副本_3.jpg', '70', '63', '100', '', '养生足弓器', '养生足弓器', '养生足弓器', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00044', '', null, null, null, '38', null);
