INSERT INTO `t_product_kd` VALUES ('643', '商务投影手机', null, '35290.00', '30000.00', '34000.00', '/attached/image/20170508/ty1_3.jpg', '2017-05-08 15:59:21', '15827476130', '18824222366', '2017-06-09 14:41:19', 'n', 'n', '888', '3', '<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;\">投影手机是集成了投影功能的手机。投影手机基于LCOS或DLP技术运用于微型投影并集成于手机中，以满足消费者便携性，娱乐性，实用性等要求。鉴于微型投影技术已发展数年，技术相对稳定成熟，即便手机增添了投影这个功能，外形却无明显变化。</span>', '15', '/attached/image/20170508/5_3.jpg,/attached/image/20170508/6_3.jpg,/attached/image/20170508/ty2_3.jpg', '75', '18', '0', null, '商务投影手机', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A00082', null, null, null, null, '38', null);
