INSERT INTO `t_product_kd` VALUES ('654', '福满乾坤(黑茶)', null, '4600.00', '4000.00', '4600.00', '/attached/image/20170510/a4_30000_1.jpg', '2017-05-09 15:24:21', '15827476130', '13237101494', '2017-06-12 11:33:15', 'n', 'n', '311', '2', '茶叶:福满乾坤<br />\r\n茶叶类别：黑茶<br />\r\n规格：960g *1提(茶罐800g+散茶160g）<br />\r\n种类：青砖茶+原叶黑茶<br />\r\n保质期：可长期 存放，越陈越香<br />\r\n<p>\r\n	储存方法：清洁、干燥、无异味 通风处保存，品质更佳！\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/福满乾坤-008_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/福满乾坤-006_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n&nbsp; &nbsp; &nbsp; 福满乾坤的罐子是由青砖茶原料压制而成，是青砖茶艺术品的代表。罐内装干精致老 青茶散茶，干茶条索紧实，色泽黑褐，茶汤入口顺滑，橙红明亮。<br />\r\n说明：羊楼洞青砖茶经长时间独特发酵后高温压制而成，不含任何添加剂！茶汤浓香可口，具有清心提神，生津止渴，暖人御寒，化滞利胃，杀菌收敛，治疗腹泻等多种功效，陈砖茶效果更好。具有降三高，利尿解毒，抗氧化，抗癌，抗辐射等功效<br />', '15', '/attached/image/20170612/福满乾坤-002_3.jpg,/attached/image/20170612/福满乾坤-003_3.jpg,/attached/image/20170612/福满乾坤-004_3.jpg,/attached/image/20170612/福满乾坤-005_3.jpg', '76', '0', '100', null, '福满乾坤(黑茶)', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000234', null, null, null, null, '38', null);
