INSERT INTO `t_product_kd` VALUES ('662', '皇冠金橡干红（进口澳洲）2瓶', null, '1000.00', '500.00', '825.00', '/attached/image/20170607/皇冠金像干红004_3.jpg', '2017-05-11 16:11:48', '13144880566', '15827476130', '2017-06-07 16:32:28', 'n', 'n', '111', '3', '<p>\r\n	<span style=\"font-size:14px;\">单位：盒/2瓶</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#000000;font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\">皇冠金橡赤霞珠干红 丰富的黑醋栗和森林浆果香气，伴随橡木、薄荷及青草的绿色气息。是一款简单易饮、果香突出的经典南澳赤霞珠。适宜当下饮用。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#000000;font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\">&nbsp;产区：南澳大利亚</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#000000;font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\">酒精度：14.0%</span><span style=\"color:#000000;\"></span> \r\n</p>', '7天', '/attached/image/20170511/hggh002_3.jpg,/attached/image/20170511/hggh003_3.jpg,/attached/image/20170511/hggh004_3.jpg,/attached/image/20170511/hggh005_3.jpg,/attached/image/20170511/hggh006_3.jpg,/attached/image/20170511/hggh007_3.jpg,/attached/image/20170607/皇冠金像干红001_3.jpg,/attached/image/20170607/皇冠金像干红003_3.jpg', '71', '0', '100', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000244', null, null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('663', '鼎烨定制健美塑身机508', null, '4600.00', '4000.00', '4600.00', '/attached/image/20170524/微信图片_201705111609031_2.jpg', '2017-05-11 16:20:42', '15827476130', '13237101494', '2017-06-12 13:31:54', 'n', 'n', '840', '2', '减肥的本质就是消耗能量燃烧脂肪，而塑身机的使用原理就是采用运动科学中的平衡侧动、振幅叠加原理，让全身脂肪运动起来，消耗热量，消除体内围积过量的脂肪。具有平腰腹、碎体脂、塑曲线等主要功能特点，但作用远不止这三方面——总结起来，让消费者不可忽视的作用，有以下七点：<br />\r\n1、帮助消除背、臂、腰、腹、臀、大腿、小腿七大部位多余脂肪；<br />\r\n2、促进胃肠蠕动，帮助清理肠道内的宿便，改善便秘，同时有效阻隔油脂，达到排毒、纤体 、养颜的效果；<br />\r\n3、紧致松弛的肌肤层，使肌肤更加紧绷、有弹性；<br />\r\n4、促进血液循环，清理血管中的脂肪；<br />\r\n5、舒缓神经衰弱，解除精神紧张；<br />\r\n6、理疗保健甩脂，治疗慢性疾病；<br />\r\n<p>\r\n	7、强健内脏，增强整体抗病能力，并减少乳酸的产生，消除腰酸背痛，缓解疲劳。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/塑身机-wu005_3.jpg\" width=\"360\" alt=\"\" />\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/塑身机001_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/塑身机-wu006_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>', '15', '/attached/image/20170612/塑身机-wu001_3.jpg,/attached/image/20170612/塑身机-wu002_3.jpg,/attached/image/20170612/塑身机-wu003_3.jpg,/attached/image/20170612/塑身机-wu004_3.jpg,/attached/image/20170612/塑身机-wu007_3.jpg', '67', '0', '100', null, '鼎烨定制健美塑身机508', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000246', null, null, null, null, '38', null);
