INSERT INTO `t_product_kd` VALUES ('678', '东风标致4008（进口）', null, '195700.00', '30000.00', '195700.00', '/attached/image/20170514/东风标致4008_3.jpg', '2017-05-14 00:38:28', '18824222366', '18824222366', '2017-05-14 00:59:38', 'n', 'n', '816', '2', '<p>\r\n	<span style=\"font-size:18px;background-color:#E53333;\">具体价格与配置请到4S店体验，购买立赠市场指导价15%等额积分，欢迎选购，详情请咨询公司</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:18px;\">动力方面，标致4008采用2.0L汽油引擎。传动方面，与CVT或手动变速箱匹配。另外，该车还提供前轮或四轮两种驱动方式。</span>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:18px;\">标致4008除了注重行驶性能，安全性能也是它的最大卖点。带高度调节的自动氙气大灯、大灯清洗系统、雾灯。在车身架构上，强化的腰线可以减少冲击对车内乘客的伤害。放置在转向柱下的安全气囊进一步保护驾驶员免受伤害，此外侧安全气囊和安全气帘也全部具备。，从申报图信息来看，低配车型将配备卤素前大灯，而高配车型则配有氙气大灯</span><span style=\"font-size:18px;\">和LED日间行车灯</span><span style=\"font-size:18px;\">。 动力方面，标致4008所搭载的是与三菱劲炫相同的型号为4B11的2.0L发动机，其最大输出功率为150马力。最高扭矩</span><span style=\"font-size:18px;\">达198Nm。与之匹配的是6速</span><b><i><span style=\"font-size:18px;\">CVT</span></i></b><span style=\"font-size:18px;\">变速器</span>\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src=\"/attached/image/20170514/东风标致4008_3.jpg\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<img src=\"/attached/image/20170514/4008东风A_3.jpg\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<img src=\"/attached/image/20170514/L4008_3.jpg\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<img src=\"/attached/image/20170514/M4008_3.jpg\" alt=\"\" /> \r\n</p>', '30天', '/attached/image/20170514/4008东风A_3.jpg,/attached/image/20170514/K4008_3.jpg,/attached/image/20170514/L4008_3.jpg,/attached/image/20170514/M4008_3.jpg,/attached/image/20170514/P4008_3.jpg', '74', '0', '30', null, '标致4008（进口）', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z00000111', null, null, null, null, '38', null);
