INSERT INTO `t_product_kd` VALUES ('691', '熊娃娃智能机器人', null, '699.00', '200.00', '699.00', '/attached/image/20170516/智能机器人-200_3.jpg', '2017-05-16 14:47:35', '15827476130', '18824222366', '2017-05-19 23:28:22', 'n', 'n', '97', '3', '<div>\r\n	<img src=\"file://C:\\Users\\Administrator\\AppData\\Roaming\\Tencent\\Users\\854110841\\QQ\\WinTemp\\RichOle\\87CGRWER81]V]3PBJ00}8JU.png\" /> \r\n</div>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:14px;\">外观尺寸</span></b><span style=\"font-size:14px;\">：125*93*175mm</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:14px;\">商品用途</span></b><span style=\"font-size:14px;\">：</span><span style=\"font-size:14px;\">人机交</span><span style=\"font-size:14px;\">流</span><span style=\"font-size:14px;\">，语音对讲，</span><span style=\"font-size:14px;\">让爸妈随时随地了解宝宝的情况</span><span style=\"font-size:14px;\">;</span><span style=\"font-size:14px;\">故事，儿歌，</span><span style=\"font-size:14px;\">让宝宝再也不会无聊了；</span><span style=\"font-size:14px;\">英语，国学，</span><span style=\"font-size:14px;\">双语对译，宝宝的英语不用愁了；</span><span style=\"font-size:14px;\">科学知识，百科全书，</span><span style=\"font-size:14px;\">满足宝宝的好奇心，开启宝宝的无限相像力；</span><span style=\"font-size:14px;\">加减乘除，</span><span style=\"font-size:14px;\">替工作繁忙的你给宝宝检查作业；育儿早教，海量的资源给孕妈妈随时说出想要的胎教故事和音乐</span><span style=\"font-size:14px;\">，定时关机，儿童锁</span> \r\n</p>\r\n<img src=\"/attached/image/20170516/894654_3.jpg\" alt=\"\" />', '15天', '/attached/image/20170516/232_3.jpg,/attached/image/20170516/2656498_3.jpg,/attached/image/20170516/2656_3.jpg,/attached/image/20170516/84646_3.jpg', '67', '0', '100', null, '鼎烨定制儿童机器人', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000255', null, null, null, null, '38', null);
