INSERT INTO `t_product_kd` VALUES ('814', '律师服务包', null, '1300.00', '1000.00', '1200.00', '/attached/image/20170525/lvshishiwusuo002-1000_3.jpg', '2017-05-25 18:34:46', '15827476130', '18824222366', '2017-05-27 11:30:14', 'n', 'n', '280', '2', '<p>\r\n	<span style=\"line-height:1.5;font-size:18px;color:#337FE5;\"><strong>朱浩壬</strong></span><span style=\"line-height:1.5;\"> </span><span style=\"line-height:1.5;font-size:18px;color:#337FE5;\"><strong>湖北赫诚律师事务所主任律师，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;font-size:18px;color:#337FE5;\"><strong>律师执业证号</strong></span><span style=\"line-height:1.5;font-size:18px;color:#337FE5;\"><strong>4212201210756087</strong></span><span style=\"line-height:1.5;font-size:18px;color:#337FE5;\"><strong>。</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\"><img src=\"/mnt/data/img/attached/image/20170526/律师名片001_3.png\" width=\"370\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	<span style=\"line-height:1.5;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1.服务范围广泛，曾为数百企业和投资项目提供法律服务，涉及的领域包括金融业，采矿业，制造业，电力、燃气及水的生产和供应业，建筑业，交通运输、仓储和邮政业，房地产业，水利、环境和公共设施管理业，教育等。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	2.服务经验丰富，具有为企业提供上市、新三板挂牌、并购重组、债券发行、投融资、常年法律顾问、私募基金管理人登记及重大事项变更等各类法律服务的丰富经验。基金业务方面，为多家基金设立、投资、私募基金管理人登记等提供专项法律服务。\r\n</p>\r\n3.<span style=\"line-height:1.5;\">服务专业称职，曾担任农业银行咸宁分行、农业银行武汉分行法律顾问；目前担任武汉市倾城思妍商贸有限公司、湖北家诚宝商贸有限公司、武汉丰谊航空服务有限公司、武汉市聚诚信食品有限公司、武汉楚汉居建筑装饰工程有限公司、咸宁市安达公司、咸宁市交通局、咸宁市马桥政府、咸安区政府、咸安区客运站等多家机关企业的常年或专项法律顾问，主要为客户提供商事诉讼、合同审查、项目谈判、投融资、公司运作、公司治理、企业知识产权战略架构、公司法律顾问、员工职务犯罪预防、企业高管人员个人法律事务处理等诉讼和非诉讼法律服务。在重大疑难刑事案件、国家工作人员贪污受贿案件、取保候审、法律风险防范等方面具有十分丰富的工作经验。</span><span style=\"line-height:1.5;\"><br />\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span>律师函样板如下:</span> \r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170525/图片1_3.png\" width=\"400\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>如需上门谈判、调解纠纷、面对面解答咨询或者</span><span style=\"line-height:1.5;\">民事出庭可拨打名片上的电话进行咨询。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170525/lvshishiwusuo003_3.jpg', '74', '0', '100', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z000lvshihan', null, null, null, null, '38', null);
