INSERT INTO `t_product_kd` VALUES ('831', '荟玫泉贵族明星护肤6件套', null, '5900.00', '5000.00', '5880.00', '/attached/image/20170603/tao五件套-5000_3.jpg', '2017-06-03 16:23:57', '15827476130', '18824222366', '2017-06-06 17:50:29', 'n', 'n', '182', '2', '<p>\r\n	荟玫泉贵族明星护肤6件套：洁颜乳 &nbsp;赋活露 &nbsp;精华液 &nbsp;精华乳 &nbsp; 水分霜 &nbsp; 面膜\r\n</p>\r\n<p>\r\n	<span style=\"font-family:simhei;font-size:14px;line-height:27px;\">无香精 无色素 无酒精 无传统防腐剂 无矿物油 无PEG乳化剂 无激素</span><img src=\"/mnt/data/img/attached/image/20170601/jieshao介绍_3.jpg\" width=\"400\" alt=\"\" /> \r\n</p>', '15', '/attached/image/20170601/洗面奶_3.jpg,/attached/image/20170601/精华乳_3.jpg,/attached/image/20170601/精华液_3.jpg,/attached/image/20170601/赋活露_3.jpg,/attached/image/20170601/霜 荟玫泉_3.jpg,/attached/image/20170603/荟玫泉-面膜_3.jpg', '77', '4', '100', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000356', null, null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('833', '能量石超值限量套装', null, '5800.00', '5000.00', '5488.00', '/attached/image/20170607/能量石003-50_3.jpg', '2017-06-06 19:34:59', '18824222366', '13237101494', '2017-06-14 14:37:23', 'n', 'n', '536', '2', '<p>\r\n	<span style=\"font-size:32px;background-color:#E53333;\">能量石超值限量套装，庆积分上线限量促销套装，原价5800，现价5488！！！仅售50套！白色能量石两套、黑色能量石两套、彩色一套。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:32px;background-color:#E53333;\"><img src=\"/attached/image/20170606/437493258_3_3_3.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:32px;background-color:#E53333;\"><img src=\"/attached/image/20170606/hei1_3_3.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:32px;background-color:#E53333;\"><img src=\"/attached/image/20170606/caiseIMG_1902_3_3.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:32px;\"><span style=\"color:#000000;font-size:14px;\">1.促进血液循环- 将更完善的营养素和氧气输送至细胞内及从细胞内排除毒素，不再出现手脚冰冷的现象。 为血细球供应能量及减低黏性，能减低罹患心血管疾病、心脏病和中风的风险。 增加新陈代谢、促进排毒功能、保持身段苗条。 舒解身体各部位的酸痛、紧绷和僵硬。</span><br />\r\n<span style=\"color:#000000;font-size:14px;\">2.预防精神疲劳，保持宁心安神，改善睡眠品质。增进精神专注力，有助上班族在工作上取得更佳的表现；有助学生在考试时保持冷静，减少焦虑及在温习时增进注意力。使需长途或经常驾驶的人士感觉更精神，不会感到疲倦或打瞌睡。</span><br />\r\n<span style=\"color:#000000;font-size:14px;\">3.使身体恢复平衡及力气，并提升身体灵活性老年人行动更有力气和平衡，不会轻易摔倒受伤。运动员如高尔夫球员，能增强体魄、耐力与力气，呈现更好的表现。增强体能、保持青春，使身体更健康、更具活力。</span><br />\r\n<span style=\"color:#000000;font-size:14px;\">4.强化人体的生物能量场以抗防有害的电磁波。保护人体免受来自围绕着我们的计算机、手机、电器、电讯塔等的电磁波伤害，使身体恢复平衡与协调。</span><span style=\"color:#000000;font-size:14px;\"></span></span>\r\n</p>', '7天', null, '74', '131', '50', null, '能量石超值限量套装', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z9898998', null, null, null, null, '38', null);
