INSERT INTO `t_product_kd` VALUES ('843', '定制折叠自行车+玉石001', null, '23000.00', '20000.00', '22380.00', '/attached/image/20170609/电动折叠自行车+玉石001_3.jpg', '2017-06-08 17:47:26', '13237101494', '13237101494', '2017-06-09 11:50:19', 'n', 'n', '0', '1', '<p>\r\n	<span style=\"font-size:14px;\">定制折叠自行车+玉石001 &nbsp;迎接积分上线，限时特价。限量50套，售完即止。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">玉坠有权威鉴定证书</span> \r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170608/881704640227243966_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/485570562453750879_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>', '15', '/attached/image/20170608/881704640227243966_3.jpg,/attached/image/20170608/图片3_3.png,/attached/image/20170609/玉石001_3.jpg', '74', '0', '50', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z000zixingche', null, null, null, null, '38', null);
INSERT INTO `t_product_kd` VALUES ('844', '三七提取素', null, '5960.00', '4000.00', '5960.00', '/attached/image/20170613/sanqi-002_3.jpg', '2017-06-12 22:21:42', '13237101494', '18824222366', '2017-06-13 18:04:22', 'n', 'n', '18', '2', '<p>\r\n	<span style=\"font-size:14px;color:#E53333;\"><img src=\"/attached/image/20170613/AAA37_3.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#E53333;\">此产品支持并参与“与爱同行吧基金”其中有1000元用来支持此公益。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	“与爱同行吧基金”是湖北省青年创业促进会下设的公益基金，改变传统的伸手要钱做慈善的模式，而是通过孵化造血项目，从中提取利润百分比支撑公益文化事业长久发展。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<img src=\"/mnt/data/img/attached/image/20170613/图片1_3.png\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170613/图片2_3.png\" width=\"360\" alt=\"\" /> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	“与爱同行吧基金”帮助空巢家庭及其他弱势群体，提供人性化良心服务，帮助政府整合民间力量，补充公益资源。\r\n</p>\r\n<img src=\"/mnt/data/img/attached/image/20170613/图片3_3.png\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170613/图片4_3.png\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170613/图片5_3.png\" width=\"360\" alt=\"\" /> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	目前与爱同行吧正在帮助的对象：\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->一、<!--[endif]--><span>四川地震地区大凉山</span>64<span>名彝族孤儿，这些孩子很多受过家庭创伤，他们有的父母亡故，有的被父母遗弃，语言不通。我们希望孩子们在学习文化课的同时，成立表演队，挖掘他们能歌善舞的天性，未来过上有尊严的生活。</span> \r\n</p>\r\n<img src=\"/mnt/data/img/attached/image/20170613/图片6_3.png\" width=\"360\" alt=\"\" /> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	二、<!--[endif]-->正在筹备“关爱中国最底层环卫工”项目，帮助他们的子女解决实际问题，实现大学梦，希望他们的子女不再走没文化的路，将来运用知识改变自己的命运。\r\n</p>\r\n<img src=\"/mnt/data/img/attached/image/20170613/图片8_3.png\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170613/图片9_3.png\" width=\"360\" alt=\"\" /> \r\n<p>\r\n	<br />\r\n</p>', '10', '/attached/image/20170613/sanqi-003_3.jpg,/attached/image/20170613/sanqi-004_3.jpg,/attached/image/20170613/sanqi-005_3.jpg', '85', '0', '100', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000349', null, null, null, null, '38', null);
