INSERT INTO `t_product_old` VALUES ('299', '鼎烨定制炒菜机', '电子商品/生活电子商品', '4680.00', '3900.00', '3900.00', '/attached/image/20170615/炒菜机003_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 14:34:34', 'y', 'n', null, '2', '鼎烨定制炒菜机\r\n<p class=\"MsoNormal\">\r\n	电压：220V\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	功率：1700W（上部400W/下部1300W）/2000W（上部400W/下部1600W）\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	配锅：炒菜锅/平底锅\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	功能：炒菜、煎烤、油炸、煮、焖、炖、煲\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	控制面板：触摸按键、LCD屏显示\r\n</p>', '15', '/attached/image/20170615/炒菜机004_3.jpg,/attached/image/20170615/炒菜机005_3.jpg', '67', '49', '81', '', '鼎烨定制炒菜机', '鼎烨定制炒菜机', '鼎烨定制炒菜机', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000185', '', null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('300', '大连特产淡干野生海参', '快消商品/特产类', '5760.00', '960.00', '4800.00', '/attached/image/20170612/大连海参001-wu_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-12 17:47:12', 'y', 'n', null, '2', '鼎烨7A淡干野生海参<br />\r\n规格：7-13只&nbsp;<br />\r\n保质期：720天<br />\r\n级别：7A &nbsp; 7A级海参为7年海参<br />\r\n干参长度：4-6厘米<br />\r\n泡发后长度：8-14厘米<br />\r\n功效：根据本草纲目记载，野生海参，具有，补肾益精，养血易髓，壮阳疗痿，降火通常，调经养胎，抗衰驻颜，平心悸，等功效。与，燕窝，鱼翅齐名，是八大营养珍品之一。号称海洋伟哥，也是抗癌灵丹其含有丰富的铁及海参胶原蛋白足可起到固本培元。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;发制方法 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 一、浸泡:将海参表面清洗干净后，浸泡在洁净无油的装有适量的纯净水的容器内(水要没过海参)泡发约24小时左右，期间换水3-4次直至海参体变软(此步骤的目的是把海参浸泡至柔软可以清洗内部的状态)。最好用纯净水(勿用自来水)，这样才能保证最终泡出来的海参个大、肉质鲜美 、营养更易吸收。<br />\r\n<br />\r\n二、清洗:沿着腹部的刀口把海参从头部至尾部剪开，剪掉头部的沙嘴和抠除海参牙(白色的硬状物)，清洗海参体内杂质和内脏，挑断海参内壁上附着的筋。 去掉内筋和肠子海参发泡的个儿会更大。海参内白筋和肠子营养丰富洗净可做汤用。<br />\r\n<br />\r\n三、锅煮:将洗净后的海参放入洁净无油的锅里加入适量纯净水，中火烧开后再小火煮30-40分钟，熄火后不要开盖，把海参留在锅里焖至自然凉透，捡出煮软的海参，将硬的或者仍有硬芯的海参留在锅中，换纯净水继续煮，直至全部煮软煮透。(此步骤的目的就是要把海参彻底煮软煮透，部分发制者喜欢煮两遍效果是一样的)。<br />\r\n<br />\r\n四、浸泡:洁净无油的容器内盛满纯净水，放入煮好的海参。然后置于电冰箱的保鲜室内，再浸泡约24-48小时，其间换水3-4次，即可食用。<br />\r\n<br />\r\n五、发制好的海参要浸泡在纯净水中并经常换水，海参应尽快食用，不可长时间浸泡或长时间带水放置在冰箱保鲜室内。<br />\r\n<br />\r\n<p>\r\n	六、如一次发制较多，不能够立刻吃完，应以保鲜袋单个盛装后放置在冰箱的冷冻室内冷冻保存，需要时用热水浸泡即可食用。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/大连海参007_3.jpg\" width=\"360\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170612/大连海参006_3.jpg,/attached/image/20170612/大连海参007_3.jpg,/attached/image/haican/1_3.jpg,/attached/image/haican/2_3.jpg,/attached/image/haican/3_3.jpg', '76', '3', '88', '', '大连特产淡干野生海参', '大连特产淡干野生海参', '大连特产淡干野生海参', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000186', '', null, null, null, '31', null);
