INSERT INTO `t_product_old` VALUES ('323', '鼎烨电动载人行李箱', '电子商品/生活电子商品', '9144.00', '1524.00', '7620.00', '/attached/image/zhinengche/微信图片_20170319160435_2.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-12 15:13:53', 'y', 'n', null, '2', '<p>\r\n	21寸\r\n</p>\r\n<p>\r\n	智能电动载人行李箱，由深圳公司自主研发专利产品，已通过多项认证，深圳龙华富士康生产。充电一次，可以走12公里，行李箱可以拆卸、折叠，又可以作为短途代步工具，是上班、逛街、买菜的代步神器。4.8公斤重，是世界上最轻的电动车。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/ktc库特车-详情介绍00_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>', '15', '/attached/image/20170516/zhengshu 000_3.jpg,/attached/image/20170516/zhengshu 111_3.jpg,/attached/image/20170516/专利证书_3.jpg,/attached/image/20170516/黑色00000_3.jpg,/attached/image/20170516/黑色222222_3.jpg,/attached/image/20170516/黑色4444444_3.jpg,/attached/image/20170517/ktc-001_3.jpg,/attached/image/20170517/ktc-002_3.jpg,/attached/image/20170517/ktc-003_3.jpg', '67', '36', '100', '', '鼎烨智能载人行李箱', '鼎烨智能载人行李箱', '鼎烨智能载人行李箱', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00024', '', null, null, null, '31', null);
