INSERT INTO `t_product_old` VALUES ('430', 'DY三磁活化能量净水器', '快消商品/生活用品类', '12000.00', '10000.00', '2100.00', '/attached/image/340/911_3.jpg', '2017-04-28 14:16:52', '', '13237101494', '2017-06-15 11:29:42', 'y', 'n', null, '2', '<p>\r\n	DY三磁活化能量净水器\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	九芯级深度净化 带来清新山泉水\r\n</p>\r\n<p>\r\n	1.本产品主要部件采用PP熔喷滤芯，UF中空纤维精密膜，高密度活性炭等优质材料制作而成，具有独特的深度净化处理效果，可有效去除水中的有害物质，保留水中的有益矿物质。\r\n</p>\r\n<p>\r\n	2.整机外壳为304不锈钢材质。\r\n</p>\r\n<p>\r\n	3.定期排污节水，不耗电节能环保。\r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">4.出水量适中，可满足家庭饮用水需求。</span> \r\n</p>\r\n<p>\r\n	5.所有部件都符合食品级要求, 安全可靠。\r\n</p>\r\n<p>\r\n	6.所有配件均采用国标配件安装简单。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170615/净水器002_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170615/净水器003_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', null, '70', '1', '99', '', 'DY三磁活化能量净水器', 'DY三磁活化能量净水器', 'DY三磁活化能量净水器', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A00012', '', null, null, null, '37', null);
