INSERT INTO `t_product_old` VALUES ('506', '北欧风情四件套（重销商城）', '快消商品/生活用品类', '2680.00', '4050.00', '609.00', '/attached/image/20170513/四件套花色标注00_3.jpg', '2017-04-28 14:16:52', '', '18824222366', '2017-05-16 22:18:54', 'y', 'n', null, '2', '<p>\r\n	<span style=\"line-height:1.5;font-size:14px;\">专版60长绒棉印花系列——风尚 &nbsp; &nbsp;<span style=\"color:#E53333;\">下单请备注花色</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">极致的质感，比普通全棉更柔软</span><br />\r\n<span style=\"font-size:14px;\"> 面料蓬松度比普通全棉提升10.8%，</span><br />\r\n<span style=\"font-size:14px;\"> 菱形蜂窝蓄热结构，持久恒温</span><br />\r\n<span style=\"font-size:14px;\"> 独特大气专版花型，</span><br />\r\n<span style=\"font-size:14px;\"> 产品特性：</span><br />\r\n<span style=\"font-size:14px;\"> ️天然纤维，100%全棉</span><br />\r\n<span style=\"font-size:14px;\"> ️亲肤触感，加倍温暖</span><br />\r\n<span style=\"font-size:14px;\"> ️吸湿透气，舒适安睡</span><br />\r\n<span style=\"font-size:14px;\"> 4 高支高密，紧密厚实</span><br />\r\n<span style=\"font-size:14px;\"> 工艺：</span><br />\r\n<span style=\"font-size:14px;\"> 1 &nbsp;枕套采用纽扣设计，简单低调</span><br />\r\n<span style=\"font-size:14px;\"> 2 &nbsp;床单采用床头7公分贴边工艺</span><br />\r\n<span style=\"font-size:14px;\"> 3 被套纽扣式封口 设计</span><br />\r\n<span style=\"font-size:14px;\"> 规格：</span><br />\r\n<span style=\"font-size:14px;\"> 标准：被套200*230 床单245*250 枕套48*74 &nbsp; &nbsp;&nbsp;</span><br />\r\n<span style=\"font-size:14px;\"> 加大：被套220*240 床单245*270 枕套48*74</span> \r\n</p>\r\n<div>\r\n	<br />\r\n</div>\r\n<p>\r\n	<br />\r\n</p>', '15', '/attached/image/20170513/SJTHS01_3.jpg,/attached/image/20170513/SJTHS02_3.jpg,/attached/image/20170513/SJTHS03_3.jpg', '70', '3', '97', '', '北欧风情四件套（重销商城）', '北欧风情四件套（重销商城）', '北欧风情四件套（重销商城）', null, 'item', '0', 'n', null, null, '0', 'n', '', 'A000190', '', null, null, null, '37', null);
