INSERT INTO `t_product_old` VALUES ('622', '鼎烨定制电动牙刷', null, '1380.00', null, '1200.00', '/attached/image/20170505/牙刷1213_3.jpg', '2017-05-05 15:13:45', '18824222366', '18824222366', '2017-05-12 08:41:05', 'n', 'n', '954', '2', '<p>\r\n	鼎烨定制电动牙刷\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>功能：</span>4<span>大模式（清洁、净白、磨光、护龈），</span><span>15</span><span>种模式组合，三种强度，刷头更换提醒，</span><span>3</span><span>秒缓动、分段计时</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>频率：</span>28200<span>～</span><span>40200</span><span>次</span><span>/</span><span>分钟</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>牙刷尺寸：</span>2.5x2.5x22.3cm\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	充电方式：无线充电\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>材料：</span>ABS/PC/POM<span>，杜邦刷毛</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>防水等级：机身</span>IPX5,<span>底座</span><span>IPX7</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>功率：</span>5W\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '15', null, '67', '108', '-8', null, '鼎烨定制电动牙刷', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000212', null, null, null, null, '31', null);
