INSERT INTO `t_product_old` VALUES ('661', '鼎烨定制健美塑身机608', null, '4600.00', null, '3900.00', '/attached/image/20170524/微信图片_20170505195906_1.jpg', '2017-05-11 16:04:19', '15827476130', '15827476130', '2017-05-24 16:35:34', 'n', 'n', '501', '2', '<span>减肥的本质就是消耗能量燃烧脂肪，而塑身机的使用原理就是采用运动科学中的平衡侧动、振幅叠加原理，让全身脂肪运动起来，消耗热量，消除体内围积过量的脂肪。具有平腰腹、碎体脂、塑曲线等主要功能特点，但作用远不止这三方面——总结起来，让消费者不可忽视的作用，有以下七点：</span><br />\r\n<span>1、帮助消除背、臂、腰、腹、臀、大腿、小腿七大部位多余脂肪；</span><br />\r\n<span>2、促进胃肠蠕动，帮助清理肠道内的宿便，改善便秘，同时有效阻隔油脂，达到排毒、纤体 、养颜的效果；</span><br />\r\n<span>3、紧致松弛的肌肤层，使肌肤更加紧绷、有弹性；</span><br />\r\n<span>4、促进血液循环，清理血管中的脂肪；</span><br />\r\n<span>5、舒缓神经衰弱，解除精神紧张；</span><br />\r\n<span>6、理疗保健甩脂，治疗慢性疾病；</span><br />\r\n<p>\r\n	7、强健内脏，增强整体抗病能力，并减少乳酸的产生，消除腰酸背痛，缓解疲劳。\r\n</p>', '15', '/attached/image/20170511/微信图片_20170505195906_1.jpg,/attached/image/20170524/微信图片_20170524160410_2.jpg,/attached/image/20170524/微信图片_2017052416051677_3.jpg,/attached/image/20170524/微信图片_20170524160521_3.jpg,/attached/image/20170524/微信图片_20170524160526_2.jpg,/attached/image/20170524/微信图片_20170524160530_3.jpg', '67', '18', '92', null, '鼎烨定制健美塑身机608', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000245', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('664', '鼎烨定制健美塑身机508', null, '4600.00', '4000.00', '3000.00', '/attached/image/20170511/微信图片_20170511160903_1.jpg', '2017-05-11 16:23:27', '15827476130', '13237101494', '2017-06-12 13:30:51', 'n', 'n', '639', '2', '<span>减肥的本质就是消耗能量燃烧脂肪，而塑身机的使用原理就是采用运动科学中的平衡侧动、振幅叠加原理，让全身脂肪运动起来，消耗热量，消除体内围积过量的脂肪。具有平腰腹、碎体脂、塑曲线等主要功能特点，但作用远不止这三方面——总结起来，让消费者不可忽视的作用，有以下七点：</span><br />\r\n<span>1、帮助消除背、臂、腰、腹、臀、大腿、小腿七大部位多余脂肪；</span><br />\r\n<span>2、促进胃肠蠕动，帮助清理肠道内的宿便，改善便秘，同时有效阻隔油脂，达到排毒、纤体 、养颜的效果；</span><br />\r\n<span>3、紧致松弛的肌肤层，使肌肤更加紧绷、有弹性；</span><br />\r\n<span>4、促进血液循环，清理血管中的脂肪；</span><br />\r\n<span>5、舒缓神经衰弱，解除精神紧张；</span><br />\r\n<span>6、理疗保健甩脂，治疗慢性疾病；</span><br />\r\n<p>\r\n	7、强健内脏，增强整体抗病能力，并减少乳酸的产生，消除腰酸背痛，缓解疲劳。\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170612/塑身机-wu005_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/塑身机001_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/塑身机-wu006_3.jpg\" width=\"360\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170612/塑身机-wu001_3.jpg,/attached/image/20170612/塑身机-wu002_3.jpg,/attached/image/20170612/塑身机-wu003_3.jpg,/attached/image/20170612/塑身机-wu004_3.jpg,/attached/image/20170612/塑身机-wu007_3.jpg', '67', '3', '82', null, '鼎烨定制健美塑身机508', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000246', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('665', '皇冠金橡干红（进口澳洲）', null, '1700.00', null, '1560.00', '/attached/image/20170607/皇冠金像干红005_3.jpg', '2017-05-11 16:42:06', '13144880566', '15827476130', '2017-06-07 16:39:21', 'n', 'n', '323', '2', '<p>\r\n	<span style=\"font-size:14px;line-height:1.5;\">单位：盒/2瓶</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\">皇冠金橡赤霞珠干红 丰富的黑醋栗和森林浆果香气，伴随橡木、薄荷及青草的绿色气息。是一款简单易饮、果香突出的经典南澳赤霞珠。适宜当下饮用。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\">&nbsp;产区：南澳大利亚</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\">酒精度：14.0%</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:tahoma, arial, simsun;font-size:14px;line-height:26px;\"><img src=\"/mnt/data/img/attached/image/20170511/hggh002_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170511/hggh007_3.jpg\" width=\"400\" alt=\"\" /></span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '7天', '/attached/image/20170511/hggh004_3.jpg,/attached/image/20170511/hggh005_3.jpg,/attached/image/20170511/hggh006_3.jpg,/attached/image/20170607/皇冠金像干红001_3.jpg,/attached/image/20170607/皇冠金像干红003_3.jpg', '71', '6', '86', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000244', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('667', '鼎烨定制泰国进口乳胶枕头（家庭套装）', null, '3500.00', null, '3180.00', '/attached/image/20170524/枕头111_3.jpg', '2017-05-11 17:14:27', '13144880566', '15827476130', '2017-05-24 11:43:54', 'n', 'n', '442', '2', '<p>\r\n	天然乳胶枕头 &nbsp;&nbsp;使用年限10~15年\r\n</p>\r\n<p>\r\n	成人枕 &nbsp; &nbsp; 天然乳胶绿色环保，抗菌除螨无静电超静音，提高睡眠舒适感超高弹性，柔韧舒适，透气排气不变形生理曲线设计，修复颈椎大颗粒按摩粒子设计，睡眠中有效按摩头部和肩膀穴位，促进血液循环，缓解肌肉劳损高低枕设计，面偏高，颈椎修复加强支持力，满足颈椎病患者病理期间睡眠需求，边稍低，颈椎正常期间使用，达到更好的健康睡眠。\r\n</p>\r\n<p>\r\n	儿童枕 &nbsp; &nbsp;适合儿童骨骼发育生长，枕头的作用是用来承托颈椎的，太高、太大、太硬都会影响胸椎（即肩椎）的向前倾斜，久而久之使孩子幼嫩的颈椎产生了变形，严重的会导致孩子驼背 选择一个适合孩子生长发育的枕头，高低两面一个枕芯可以用到孩子成年！\r\n</p>', '15', '/attached/image/20170511/微信图片_20170511165536_1.jpg,/attached/image/20170511/微信图片_20170511165540_3.jpg,/attached/image/20170511/微信图片_20170511165543_3.jpg,/attached/image/20170524/微信图片_20170524111119_1.jpg,/attached/image/20170524/微信图片_20170524111128_3.jpg,/attached/image/20170524/微信图片_20170524111139_1.jpg,/attached/image/20170524/微信图片_20170524111156_2.jpg', '70', '29', '71', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000247', null, null, null, null, '31', null);
