INSERT INTO `t_product_old` VALUES ('693', '熊娃娃智能机器人', null, '2280.00', null, '2280.00', '/attached/image/20170609/智能机器人001_3.jpg', '2017-05-16 16:13:37', '15827476130', '13237101494', '2017-06-09 17:11:38', 'n', 'n', '967', '2', '<p class=\"MsoNormal\">\r\n	<img src=\"/mnt/data/img/attached/image/20170609/智能机器人010_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170609/智能机器人009_3.jpg\" width=\"360\" alt=\"\" />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:14px;\">商品用途</span></b><span style=\"font-size:14px;\">：</span><span style=\"font-size:14px;\">人机交</span><span style=\"font-size:14px;\">流</span><span style=\"font-size:14px;\">，语音对讲，</span><span style=\"font-size:14px;\">让爸妈随时随地了解宝宝的情况</span><span style=\"font-size:14px;\">;</span><span style=\"font-size:14px;\">故事，儿歌，</span><span style=\"font-size:14px;\">让宝宝再也不会无聊了；</span><span style=\"font-size:14px;\">英语，国学，</span><span style=\"font-size:14px;\">双语对译，宝宝的英语不用愁了；</span><span style=\"font-size:14px;\">科学知识，百科全书，</span><span style=\"font-size:14px;\">满足宝宝的好奇心，开启宝宝的无限相像力；</span><span style=\"font-size:14px;\">加减乘除，</span><span style=\"font-size:14px;\">替工作繁忙的你给宝宝检查作业；育儿早教，海量的资源给孕妈妈随时说出想要的胎教故事和音乐</span><span style=\"font-size:14px;\">，定时关机，儿童锁</span> \r\n</p>', '15天', '/attached/image/20170609/智能机器人002_3.jpg,/attached/image/20170609/智能机器人003_3.jpg,/attached/image/20170609/智能机器人004_3.jpg,/attached/image/20170609/智能机器人005_3.jpg,/attached/image/20170609/智能机器人006_3.jpg,/attached/image/20170609/智能机器人007_3.jpg,/attached/image/20170609/智能机器人008_3.jpg', '67', '48', '52', null, '鼎烨定制儿童机器人', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000255', null, null, null, null, '31', null);
