INSERT INTO `t_product_old` VALUES ('730', '鼎烨定制果汁料理机', null, '380.00', null, '368.60', '/attached/image/20170517/8_3.png', '2017-05-17 16:43:41', '13144880566', 'admin', '2017-05-20 21:17:23', 'n', 'n', '131', '2', '<span>. 产品描述：便携式果汁料理机：三杯一机，使用不窜味，双刀座配用，适用于各种不同食材，电机稳定（300W）清洗方便杯体与刀座可直接冲洗，（机身不可水洗）三杯合一：大杯600ml：适合各种果汁及食材搅拌，中杯300ml：专为宝宝定制、研磨搅拌杯：适合干磨和绞肉！</span>', '15', '/attached/image/20170517/4_3.png,/attached/image/20170517/6_3.png', '70', '0', '100', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000214', null, null, null, null, '37', null);
INSERT INTO `t_product_old` VALUES ('739', '鼎烨旅游相亲碰碰会&木兰草原', null, '3580.00', null, '2880.00', '/attached/image/20170602/旅游相亲001_3.jpg', '2017-05-21 23:11:36', '18824222366', '13237101494', '2017-06-02 17:03:17', 'n', 'n', '634', '2', '<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"line-height:150%;font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span><span style=\"font-family:宋体;font-size:11pt;\"><span>报价包含：</span></span><span style=\"font-family:宋体;font-size:11pt;\"></span> </span></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:12pt;font-weight:bold;\" class=\"15\"><span>活动费：活动组织、策划、横幅、水</span>2瓶/人/天等</span></b><span style=\"font-family:宋体;color:#0762e9;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>1、</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>教练：拥有教练资格证专业教练</span> </span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>2、</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>用车：空调大巴</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">3、道具：专业的项目道具、分队服</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">4、保险：拓展意外险</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">5、门票：景区大么品</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">6、餐：三正一早 </span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">7、住：草原酒店标间</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">8、篝火晚会场地费</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">9、包粽子材料设备。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span><img alt=\"\" src=\"/attached/image/20170521/11-相亲_3.jpg\" /><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"line-height:150%;font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>一、景区简介：木兰草原</span></span></b><b><span style=\"line-height:150%;font-family:宋体;background:#ffffff;color:#000000;font-size:18pt;font-weight:bold;\">&nbsp;&nbsp;</span></b><b><span style=\"line-height:150%;font-family:\'Times New Roman\';background:#ffffff;color:#000000;font-size:18pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"><span>去木兰草原的</span>N大理由</span></b><b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"><span>理由</span>1</span></b><b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"><span>木兰草原是目前华中地区唯一的以草原风情为主题的</span>AAAAA级风景区。</span></b><b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"><span>理由</span>2</span></b><b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"><span>步入王子草场这里有清新的空气，白云和蓝天，你可信马由僵，亦可闲庭漫步！</span></span></b><b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"><span>理由</span>3</span></b><b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"><span>木兰草原在每年的七月到九月开满了格桑花，仿佛去到了那个离天堂最近的地方。</span></span></b><b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"><span>理由</span>4</span></b><b><span style=\"font-family:微软雅黑;color:#c00000;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"><span>木兰草原可以带领大家一起领略武汉木兰草原悠扬的草原文化和具有传奇的塞北风情。</span></span></b><b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"><span>木兰草原</span>——华中唯一的AAAAA级蒙古风情景区，位于武汉黄陂王家河镇街聂家岗，荆楚名山——木兰山东面，湖北十大休闲度假区——木兰湖的南面，属“木兰八景”之一。景区距武汉市城区36公里，最近的高速出口12公里，交通十分便捷。景区规划面积4800亩，分为草原风情旅游区和休闲度假区，融草原风情观光、户外拓展、水上游乐、商务会议、休闲度假为一体，是目前华中地区唯一的以草原风情为主题的AAAAA级风景区。</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span></span><b><span style=\"line-height:150%;font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\">2、本次主题拓展旅游活动概况</span></b><span style=\"font-family:\'Times New Roman\';font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>活动时间：</span>2017年 &nbsp;5 &nbsp;月 &nbsp;28-29 &nbsp;日</span></b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>活动主题：</span></span></b><b><span style=\"font-family:宋体;color:#c00000;font-size:12pt;font-weight:bold;\"><span>告别单身，我们约会吧！</span></span></b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>活动地点：木兰草原</span></span></b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>活动单位：武汉万智创烨有限公司</span></span></b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>参加人数：</span>50人</span></b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>活动目的：</span></span></b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:30pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:125%;font-family:宋体;font-size:12pt;\"><span>我们的核心宗旨为会员的员工进行庆祝佳节，带给他们幸福欢乐、愉悦轻松的情感享受，既解决现实问题，也庆祝佳节，希望我的会员可以找到自己的另一半。放开自我，要努力想寻找幸福。</span></span><span style=\"line-height:125%;font-family:\'Arial Narrow\';font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:\'Times New Roman\';color:#0000ff;font-size:14pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span></span><b><span style=\"line-height:150%;font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>四</span></span></b><b><span style=\"line-height:150%;font-family:宋体;font-size:11pt;font-weight:bold;\"><span>、</span></span></b><b><span style=\"line-height:150%;font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>活动流程</span></span></b><b><span style=\"line-height:150%;font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<table style=\"width:471pt;border-collapse:collapse;\" class=\"MsoNormalTable\" align=\"center\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"background:#9bbb59;\" valign=\"center\" width=\"104\">\r\n					<p class=\"p