ize:14pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:11pt;\"><span>本节游戏开始，男女双方分两组上台进行对抗。游戏选定一名男生代表和一名女生代表作为背人者，后面队伍中的选手轮流骑到背人者的背上进行石头、剪刀、布游戏，赢的换下一位选手直到队伍中所有人都背过了为最终胜利。游戏输的一方将接受赢的一方做出的惩罚。</span></span><span style=\"font-family:宋体;font-size:11pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>3：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>恋请猜猜看</span>·心有灵犀</span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:11pt;\"><span>所有人员共分</span>5大组，每大组出一对，其中一人a看题板模仿动作，另外一人猜，各有3个题目，可以选择过，可以选择向队友求援，救援者也采用模仿动作的方式进行。3个题目一过，获一组。其他人可以干扰别组的人。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:11pt;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>项目</span>4：</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"><span>指压板接力赛</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:14pt;font-weight:bold;\">&nbsp;</span></b><b><span style=\"font-family:楷体_GB2312;color:#c00000;font-size:9pt;font-weight:bold;\">&nbsp;</span></b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:9pt;\"><span>指压板挑战分为三个项目进行</span>,激情跳大绳、猪八戒背媳妇、幸福碰碰碰、旋风接力、仰卧起坐10个（体重最大的做，女生压腿）</span><span style=\"font-family:宋体;background:#ffffff;color