yle=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>宣布篝火晚会圆满结</span></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span>&nbsp;</span></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span></span><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"><span>九、安全保证：</span></span></b><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;background:#ffffff;\" class=\"MsoNormal\">\r\n	<b><b><span style=\"font-family:宋体;color:#ff0000;font-size:12pt;font-weight:bold;\"><span>为了保证本次拓展效果，保障活动人员的安全，请您认真阅读并遵守一下相关说明：</span></span></b><b><span style=\"font-family:宋体;color:#ff0000;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"><span>关于安全</span>:</span></u></b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>拓展训练始终如一地将安全保障放在各项工作的首位，所有活动均经过精心的设计与实验。一</span></span><span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>流的专业器材、丰富经验的培训师，让您在百分百安全中体验快乐、提升自我、熔炼团队。</span></span><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>学员准备：</span></span></b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"></span></u></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>着运动装（女士请着长裤！！）、穿运动鞋，切勿穿高跟鞋、拖鞋、凉鞋</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>住宿的学员请备好足够的换洗衣服</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>请做好防晒工作，准备好防晒霜等物品</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>积极开放的心态将有助您取得良好成绩</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>相信团队的力量，相互协作、积极沟通、主动参与</span></span><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>注意事项：</span></span></b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">1、以下情况不允许参加训练:心脏病、脑淤血、癫痫、孕妇、习惯性脱臼、较重的颈</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>椎腰椎疾病、骨坏死、肌无力，以及各种传染病正处于发病期的患者。</span></span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">2、其它疾病和身体残疾的学员须预先申明，在得到培训师允许的情况下方可参加培训；但培训中仍须随时与培训师保持沟通和确认。</span><b><span style=\"font-family:\'Times New Roman\';color:#0000ff;font-size:12pt;font-weight:bold;\"></span></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">3、培训休息期间请勿攀爬基地内的各类训练设施，以免发生意外</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">4、培训期间请服从培训师和基地人员的管理，课余期间严禁喝酒和赌博</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">5、培训期间，请不要离开您所在的小组单独活动，如有困难请向培训师要求帮助</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">6、在培训中，您身体如有不适，请及时向本队队长和培训师通报</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">7、在培训中请爱护基地内的各项设施以及自然环境，不要乱丢垃圾</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>出行要求：</span></span></b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"></span></u></b> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">1、在规定的时间到达指定集合场地，风雨无阻（我们会备足雨具，雨中活动效果更佳）</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">2、按照规定着装（运动装为宜，女士不能穿裙子），佩戴活动专用帽</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">3、穿较为防滑的旅游鞋或运动鞋，请勿穿皮鞋、高跟鞋</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">4、根据天气预报，结合自身身体状况酌情携带、添加衣物</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;margin-left:5.25pt;\" class=\"MsoNormalIndent\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\">5、根据自身情况携带私用药品</span><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"></span> </b> \r\n</p>\r\n<p style=\"text-align:left;text-indent:0pt;\" class=\"MsoNormalIndent\">\r\n	<b><b><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;\"><span>环保要求：</span></span></b><b><u><span style=\"font-family:宋体;color:#000000;font-size:12pt;font-weight:bold;text-decoration:underline;\"></span></u></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;color:#000000;font-size:12pt;\"><span>我们倡导无踪迹出行，拓展期间的所有垃圾都要回收到指定存放区域。</span></span> </b> \r\n</p>\r\n<b> \r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;background:#ffffff;color:#000000;font-size:10pt;\"><span></span></span><b><span style=\"font-family:楷体_GB2312;color:#000000;font-size:14pt;font-weight:bold;\"></span></b>&nbsp;\r\n</p>\r\n</b></b> \r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:微软雅黑;font-size:9pt;font-weight:bold;\"></span></b>&nbsp;\r\n</p>', '15', '/attached/image/20170521/22-相亲_3.jpg,/attached/image/20170521/33-相亲_3.jpg,/attached/image/20170521/44-相亲_3.jpg,/attached/image/20170521/55-相亲_3.jpg,/attached/image/20170521/DDDD_3.jpg', '74', '12', '999', null, '木兰草原相亲趣味拓展', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z1111xiangqin', null, null, null, null, '31', null);
