INSERT INTO `t_product_old` VALUES ('760', '移动电源套装', null, '168.00', '100.00', '150.00', '/attached/image/20170523/微信图片_2017052314361566_1.jpg', '2017-05-23 14:39:24', '15827476130', '18824222366', '2017-05-27 22:19:57', 'n', 'n', '314', '2', '<h3 class=\"tb-main-title\" style=\"font-size:16px;color:#3C3C3C;font-family:tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	U盘笔充电宝移动电源套装礼盒\r\n</h3>\r\n<h3 class=\"tb-main-title\" style=\"font-size:16px;color:#3C3C3C;font-family:tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	10000毫安超薄便携小巧鼎烨定制\r\n</h3>\r\n<p>\r\n	<span style=\"font-size:24px;\">内含充电宝一个，大容量U盘一个，高端水性签字笔一支</span> \r\n</p>', '7天', '/attached/image/20170523/微信图片_20170523143615_3.jpg,/attached/image/20170523/微信图片_20170523143642_3.jpg,/attached/image/20170523/微信图片_20170523143647_1.jpg,/attached/image/20170523/微信图片_20170523143652_3.jpg', '67', '1', '99', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000347', null, null, null, null, '37', null);
INSERT INTO `t_product_old` VALUES ('761', 'ACL理财包', null, '3600.00', null, '3500.00', '/attached/image/20170527/ACL01_4_1.jpg', '2017-05-23 15:35:30', '15827476130', '13237101494', '2017-06-09 17:42:46', 'n', 'n', '2381', '2', '<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0pt;text-indent:2em;text-align:justify;\">\r\n	<span style=\"color:#337FE5;\"><strong>拆分模式是一种已经被验证成功的理财模式。第一代拆分理财</strong></span><span style=\"color:#337FE5;\"><strong>SMI</strong></span><span style=\"color:#337FE5;\"><strong>已经稳稳地走了十年时间。在这十年的时间里，</strong></span><span style=\"color:#337FE5;\"><strong>SMI</strong></span><span style=\"color:#337FE5;\"><strong>创造了无数的财富神话。今天，</strong></span><span style=\"color:#337FE5;\"><strong>ACL</strong></span><span style=\"color:#337FE5;\"><strong>国际拆分理财平台作为第四代拆分平台，期待您的加入与一起并肩成长。</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0pt;text-indent:2em;text-align:justify;\">\r\n	<span style=\"color:#337FE5;\"><strong>ACL</strong></span><span style=\"color:#337FE5;\"><strong>，是美国一家多元化的投资公司，深深植根于美国本土市场，放眼全球，重点投资于旅游、教育、不动产和医疗等行业。自</strong></span><span style=\"color:#337FE5;\"><strong>2010</strong></span><span style=\"color:#337FE5;\"><strong>年创立以来，公司已在美国的投资、文化、商业和移民等领域积累了全面而深入的知识和经验。同时，</strong></span><span style=\"color:#337FE5;\"><strong>ACL</strong></span><span style=\"color:#337FE5;\"><strong>与业内顶级机构密切沟通、广泛合作，为客户提供最有效的投资方案。</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<span style=\"color:#337FE5;\"><strong>2016</strong></span><span style=\"color:#337FE5;\"><strong>年</strong></span><span style=\"color:#337FE5;\"><strong>7</strong></span><span style=\"color:#337FE5;\"><strong>月</strong></span><span style=\"color:#337FE5;\"><strong>16</strong></span><span style=\"color:#337FE5;\"><strong>日，</strong></span><span style=\"color:#337FE5;\"><strong>ACL</strong></span><span style=\"color:#337FE5;\"><strong>公司在中国首发启动</strong></span><span style=\"color:#337FE5;\"><strong>ACL</strong></span><span style=\"color:#337FE5;\"><strong>国际拆分理财项目，公司利用拆分模式在中国推行她的商业计划。同年</strong></span><span style=\"color:#337FE5;\"><strong>11</strong></span><span style=\"color:#337FE5;\"><strong>月</strong></span><span style=\"color:#337FE5;\"><strong>8</strong></span><span style=\"color:#337FE5;\"><strong>日在美国拉斯维加斯的永利酒店宣布</strong></span><span style=\"color:#337FE5;\"><strong>ACL</strong></span><span style=\"color:#337FE5;\"><strong>国际拆分理财项目正式启动全球市场。</strong></span><span style=\"color:#337FE5;\"><strong>2017</strong></span><span style=\"color:#337FE5;\"><strong>年</strong></span><span style=\"color:#337FE5;\"><strong>2</strong></span><span style=\"color:#337FE5;\"><strong>月</strong></span><span style=\"color:#337FE5;\"><strong>28</strong></span><span style=\"color:#337FE5;\"><strong>日，亚太会议在中国澳门成功召开，公司在会议上宣布了多种利好消息，为中国市场注入强劲的兴奋剂。</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;text-indent:2em;\">\r\n	<strong>【商品属性】</strong> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<span style=\"color:#E53333;\"><strong>ACL</strong></span><span style=\"color:#E53333;\"><strong>目前只开放到三个级别的投资，单账号收益如下：</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<span style=\"color:#E53333;\"><strong>一星，</strong></span><span style=\"color:#E53333;\"><strong>700</strong></span><span style=\"color:#E53333;\"><strong>元投资，毛收益</strong></span><span style=\"color:#E53333;\"><strong>4200</strong></span><span style=\"color:#E53333;\"><strong>元，纯现金收益为：</strong></span><span style=\"color:#E53333;\"><strong>2268</strong></span><span style=\"color:#E53333;\"><strong>元。（一星为重销商城单品的单价。）以下项目需叠加购买单品700元/每单，依次类推。</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<span style=\"color:#E53333;\"><strong>二星，</strong></span><span style=\"color:#E53333;\"><strong>3500</strong></span><span style=\"color:#E53333;\"><strong>元投资，毛收益</strong></span><span style=\"color:#E53333;\"><strong>21000</strong></span><span style=\"color:#E53333;\"><strong>元，纯现金收益为：</strong></span><span style=\"color:#E53333;\"><strong>11340</strong></span><span style=\"color:#E53333;\"><strong>元。</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<span style=\"color:#E53333;\"><strong>三星，</strong></span><span style=\"color:#E53333;\"><strong>21000</strong></span><span style=\"color:#E53333;\"><strong>元投资，毛收益</strong></span><span style=\"color:#E53333;\"><strong>126000</strong></span><span style=\"color:#E53333;\"><strong>元，纯现金收益为：</strong></span><span style=\"color:#E53333;\"><strong>68040</strong></span><span style=\"color:#E53333;\"><strong>元。</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<span style=\"color:#E53333;\"><strong>如果投资者把投资时间目标定为一年半时间，在这一年半的时间里，不停地做复投动作，即拆分核心思想的</strong></span><span style=\"color:#E53333;\"><strong>“三进三出”，那么投资收益将会远远大于单账号收益，并且收益会超乎您的想像！</strong></span> \r\n</p>\r\n<div>\r\n	<br />\r\n</div>\r\n<p style=\"text-indent:2em;\">\r\n	<br />\r\n</p>', '5', '/attached/image/20170526/BACL_3.jpg,/attached/image/20170526/DACL_3.jpg', '74', '70', '8', null, 'ACL理财包', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'Z000362', null, null, null, null, '31', null);
