INSERT INTO `t_product_old` VALUES ('815', '维森奈尔太阳镜', null, '1580.00', null, '1280.00', '/attached/image/20170527/眼镜AA_3.jpg', '2017-05-27 08:30:19', '18824222366', '18824222366', '2017-05-27 08:43:31', 'n', 'n', '712', '2', '<p>\r\n	<span style=\"font-size:32px;color:#E53333;\">请购买后与商场客服联系备注所需款式或厂家售前电话确认款式与尺寸。下附各款式详细说明↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓<span style=\"color:#E53333;font-size:32px;line-height:48px;\">↓</span></span></span></span></span></span></span></span></span></span></span></span></span> \r\n</p>\r\n<p>\r\n	<img src=\"/attached/image/20170527/A眼镜_3.jpg\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	一：款式解析（男士推荐C款、女士更多选择）<br />\r\nA款铝镁合金偏光太阳镜：铝镁合金镜框材质，钢铁般坚硬，羽毛般轻盈，不过敏，抗腐 蚀。采用TAC强化偏光镜片。<br />\r\n功能：阻挡紫外线，消除炫光，缓解视觉疲劳，自然色彩，视觉清晰，防爆镜片。<br />\r\n<br />\r\nB款：经典时尚，TAC片，防水防油镀膜。<br />\r\n抗疲劳，防止刺眼，阻挡紫外线，消除炫光，缓解视觉疲劳，自然色彩，视觉清晰，防爆镜片，易清洁。优质合金。<br />\r\n<br />\r\nC款：推荐款（你不可错过的一款偏光太严谨）、百搭（长方形脸、国字脸、倒三角脸、圆形脸、三角形脸、方形脸）。可外扩镜角，舒适佩戴。 &nbsp; &nbsp; 材质：TAC镜片、优质金属合金。<br />\r\n<br />\r\nE款：经典蛤蟆款，经典传承，抗疲劳，防止刺眼，阻挡紫外线，消除炫光，缓解视觉疲劳，自然色彩，视觉清晰，防爆镜片，易清洁。优质合金，树脂镜片，<br />\r\n<br />\r\nD款：铝镁合金。强化偏光镜片。防紫外线UV400，遮阳，防强光，<br />\r\n<br />\r\nF款，潮流经典蛤蟆镜，航空铝镁合金，超轻，抗压强，散热好。弹簧镜脚适合任何脸型。<br />\r\n<br />\r\nGHIK款：优质偏光片，UV400。优质合金镜框。<br />\r\n抗疲劳，防止刺眼，阻挡紫外线，消除炫光，缓解视觉疲劳，自然色彩，视觉清晰，防爆镜片，易清洁。优质合金。<br />\r\n<br />\r\nJ款：抗UV等级：UV400 &nbsp; 风格：优雅 &nbsp; &nbsp;可见光透视率：99（％） 介绍：百搭瘦脸（方形脸、国字脸、鹅蛋脸、瓜子脸、椭圆脸）、服装百搭。<br />\r\n<br />\r\n二、其他说明<br />\r\n1、关于色差<br />\r\n本店所有商品均为实物拍摄，因技术、显示器、光线、环境原因可能稍有色差现象，敬请理解。对色差高度敏感的买家，请到实体店试戴后再来选购。<br />\r\n2、关于退换<br />\r\n质量问题包换、包退，来回邮费卖家承担;<br />\r\n非质量问题退货或换货（前提要确保宝贝全新,未使用,并不影响再次销售），来回邮费由买家承担。<br />\r\n所有退换需在收到商品24小时内联系确认，并在72小时内将商品寄回，逾期将不受理。<br />\r\n3、签收须知<br />\r\n当您收到包裹的时候，请不要急于在收货单上签字，请一定要当着快递人员的面打开当场验货，如宝贝有损坏或数量缺少请一定拒收！一旦签字即表示您对货品的数量内容及完好性予以认可，我们将无法为会员们向快递公司索赔了！也请恕商场不再承担由货品内容不符、缺少或者损坏造成的损失！收到物品后有任何问题请及时联系我们！ 我们与您一起解决问题。让您满意而归！最后，祝各位家人购物愉快！\r\n</p>', '10天', '/attached/image/20170527/B眼镜_3.jpg,/attached/image/20170527/D眼镜_3.jpg,/attached/image/20170527/EF眼镜_3.jpg,/attached/image/20170527/H 眼镜_3.jpg,/attached/image/20170527/JJ眼镜_3.jpg', '74', '25', '75', null, '维森奈尔太阳镜', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000343', null, null, null, null, '31', null);
