INSERT INTO `t_product_old` VALUES ('822', '健康活氧解毒机', null, '1980.00', null, '1800.00', '/attached/image/20170529/B健康解毒机_副本_1.jpg', '2017-05-29 10:12:11', '18824222366', '18824222366', '2017-05-29 10:33:13', 'n', 'n', '196', '2', '<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<strong><span><img src=\"/attached/image/20170529/B健康解毒机_副本_3.jpg\" alt=\"\" /><br />\r\n</span></strong> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<strong><span>★产品简介</span></strong> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span>&nbsp;&nbsp;在多年研发的基础上，结合最新活氧科技，推出新一代环保小家电系列多功能活氧机。它是利用高频高压放电产生的活氧，来达到杀菌消毒的目的。活氧（俗称臭氧），具有强氧化性，是广谱、高效的杀菌消毒剂。人们在雷雨后，总是感觉空气特别清新，这就是活氧作用的原故。</span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:24px;font-size:16px;\"><span>活氧在一定浓度下即可转化成氧气，没有任何有毒残留，不会形成二次污染，被誉为最清洁的氧化剂和消毒剂。π健康活氧解毒机采用用先进技术制造，利用臭氧的氧化杀菌功能，精心研制而成的新一代多功能解毒机。它既能能杀灭细菌病毒，降解瓜果蔬菜、肉类海鲜上残留的农药和激素。有效清除蔬菜、水果、鱼、肉中残留的农药、化肥等有害物质并可杀灭大肠杆菌、葡萄球菌、等多种有害病菌；更可以分解苯类、醛类等。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:24px;font-size:16px;\"><span> </span></span>\r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:21px;color:#E53333;\"><strong><span>★主要功能</span></strong></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span>一、能充分降解果蔬中的残留农药，杀灭表面的细菌病毒。既不改变食物的味道，还延长保鲜期。适用于各种水果、蔬菜如黄瓜、西红柿、萝卜及凉拌菜、腌制菜的清洗。<br />\r\n</span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span><span><span> 二、能祛除肉类食品中的添加剂、激素。洗涤鱼肉类、海鲜贝类，可除去腥味，祛除其表面的细菌，且洗涤后的肉质更鲜美、细嫩。</span><br />\r\n</span></span> \r\n</p>\r\n<br />\r\n<span style=\"color:#C0BDBB;font-family:\'Microsoft YaHei\', \'Helvetica Neue\', SimSun;font-size:14px;line-height:21px;background-color:#000000;\"></span> \r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 三、能有效祛除室内的诸如烟味、油漆味、臭味等各种异味，并能充分分解新居墙壁、家具散发的甲苯、甲醛等有毒气体，净化空气，保持室内空气清新自然。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 四、可用于冰箱的除臭与食品保鲜。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 五、可用于日常生活用品的杀菌消毒：如餐具、衣物等，特别是宝宝的玩具、奶瓶，妇女的内衣等。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 六、衣柜、鞋柜除臭、防霉。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 七、用活氧水洗涤衣物，可杀菌除臭，祛除洗涤剂残留，洗后的衣物更亮丽。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 八、净化水质，增氧、脱色，水质清澈。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 九、护肤美容，可清除毛孔内的细菌和污物，增加皮肤的呼吸功能，活化皮肤细胞，促进血液循环，加速新陈代谢，令肌肤洁白，光滑细腻。用活氧水洗脸，可收缩毛孔能有效地清除化妆残留物，安全卸妆。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> 十、杀菌消毒，预防真菌感染。可预防各种脚气病。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> ▲活氧又称臭氧，化学名O3，具有特殊鱼腥味的蓝色气体，具有强氧化性，是至今被发现的最强的氧化剂之一，其氧化能力仅次于氟，在一定浓度下即可转化成氧气，没有任何残留，不会形成二次污染，被誉为“最清洁的氧化剂和消毒剂”。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span> ★臭氧是一种具有广泛性的、高效的快速杀菌剂，它可以杀灭使人和动物致病的多种病菌、病毒及微生物。它的消毒机理是：通过在较短的时间内破坏细菌、病毒和其他微生物的结构，使之失去生存能力。臭氧的杀菌作用是快速的，当其浓度达到一定数值后，消毒杀菌甚至可以瞬间完成。臭氧对很多病菌、霉菌、病毒、真菌、原虫、卵囊都具有明显的灭活效果，且就灭菌时间来说，迅速无比，是氯的300～600倍，紫外线的3000倍。</span></span> \r\n</p>\r\n<p style=\"font-size:14px;font-family:微软雅黑;color:#3E3E3E;background-color:#FFFFFF;\">\r\n	<span><span><span> ★由于臭氧具有的上述神奇作用，所以可以广泛应用于医疗、卫生保健、食品饮料加工储存、果蔬灭菌保鲜、生活饮用水处理、建筑物二次供水处理、医院污水和工业废液处理、渔业养殖、游泳池消毒灭菌以及公共场所、家庭等多个领域并取得显著成效。因此，臭氧及其利用技术是世界公认的二十一世纪环境保护科学的四大关键技术之一。到目前为止，欧美日等发达国家的城市供水，有90%以上均采用臭氧进行消毒灭菌。甚至法国、英国、美国、日本、韩国等国家已通过立法，规定所有饮用水必须通过臭氧终端消毒后，才能提供给用户。</span></span></span> \r\n</p>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>', '7天', null, '67', '3', '27', null, '健康活氧解毒机', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000351', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('823', '植物酵素饮', null, '1280.00', null, '998.00', '/attached/image/20170612/植物酵素111-001_3.jpg', '2017-05-29 14:51:45', '18824222366', '13237101494', '2017-06-12 16:53:44', 'n', 'n', '123', '2', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	植物酵素饮 8瓶/盒x5\r\n</p>\r\n<p>\r\n	产品剂型：液体 &nbsp;\r\n</p>\r\n<p>\r\n	储藏方式：常温下密封保存 &nbsp;置于阴凉干燥处 &nbsp;\r\n</p>\r\n<p>\r\n	保健作用：排毒养颜 &nbsp;&nbsp;\r\n</p>\r\n<p>\r\n	适宜人群：配胖 &nbsp;便秘人群 &nbsp;\r\n</p>\r\n<p>\r\n	是否含防腐剂：否\r\n</p>\r\n<img src=\"/mnt/data/img/attached/image/20170612/植物酵素777_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/植物酵素5-002_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/植物酵素5-003_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/植物酵素5-005_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170612/植物酵素007_3.jpg\" width=\"360\" alt=\"\" /> \r\n<p>\r\n	<br />\r\n</p>', '7天', '/attached/image/20170612/植物酵素222-002_3.jpg,/attached/image/20170612/植物酵素333-333_3.jpg', '74', '0', '99', null, '植物酵素饮', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000352', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('826', '鼎烨定制LM1手机', null, '7250.00', null, '7250.00', '/attached/image/20170602/Lm1-5.5主图_3.jpg', '2017-06-02 10:49:11', '13237101494', '18824222366', '2017-06-06 17:47:21', 'n', 'n', '288', '2', '<p class=\"MsoNormal\">\r\n	1. 5.5<span>寸蓝光曲面无边框屏</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>蓝光</span>+<span>曲面，目前市场少有同类型高端配置机器。无边框屏正是目前消费者关注和喜爱的最热卖点。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2. 4G<span>运行，</span><span>64G</span><span>机身内存</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->3.&nbsp;<!--[endif]--><span>前置</span>1300<span>万双摄单反级拍摄，后置</span><span>2100</span><span>万双摄单反级拍摄</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->4.&nbsp;<!--[endif]--><span>固态指纹解锁更快更安全</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->5.&nbsp;<!--[endif]-->FHD<span>高分辨率超高清显示，目前业内高端机最顶级的护眼显示屏</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->6.&nbsp;<!--[endif]-->3800MA<span>电池大容量更持久，</span><span>原装</span>SONY<span>电芯，品质保障</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->7.&nbsp;<!--[endif]--><span>亮黑，土豪金，玫瑰金任选</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->3.&nbsp;<!--[endif]--><span>全网通。电信，移动，联通卡都可以用。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->4.&nbsp;<!--[endif]--><span>机身外观时尚美观，机器大小尺寸合适，厚薄适中，握感舒服，是一款配置高，颜值高，品质稳定，回头率高的机器</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span><img src=\"/mnt/data/img/attached/image/20170602/1_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/2_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/3_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/4_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/5_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/6_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/7_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/8_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/9_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/10_3.jpg\" width=\"400\" alt=\"\" /><br />\r\n</span> \r\n</p>', '7天', '/attached/image/20170602/Lm1-5.5-001_3.jpg,/attached/image/20170602/Lm1-5.5-002_3.jpg,/attached/image/20170602/Lm1-5.5-003_3.jpg,/attached/image/20170602/Lm1-5.5-004_3.jpg,/attached/image/20170602/Lm1-5.5-005_3.jpg,/attached/image/20170602/Lm1-5.5-006_3.jpg', '75', '33', '89', null, '鼎烨定制Lm1', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000354', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('827', '鼎烨定制LM6S手机', null, '6980.00', null, '6980.00', '/attached/image/20170602/s6-主图_3.jpg', '2017-06-02 11:29:32', '13237101494', '18824222366', '2017-06-06 17:47:12', 'n', 'n', '274', '2', '<p class=\"MsoNormal\">\r\n	1. 6.0<span>寸高清护眼屏</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2. 4G<span>运行，</span><span>64G</span><span>机身内存</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->3.&nbsp;<!--[endif]--><span>前置</span>1300<span>万双摄单反级拍摄，后置</span><span>2100</span><span>万双摄单反级拍摄</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->4.&nbsp;<!--[endif]--><span>固态指纹解锁更快更安全</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->5.&nbsp;<!--[endif]-->FHD<span>高分辨率显示屏，目前业内高端机顶级超高护眼屏</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->6.&nbsp;<!--[endif]--><span>最新金属高光拉丝工艺。外观更时尚。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->7.&nbsp;<!--[endif]-->3800MA<span>电池大容量续航更持久</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->8.&nbsp;<!--[endif]--><span>黑，金两色可选</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<!--[if !supportLists]-->9.&nbsp;<!--[endif]--><span>全网通。电信，移动，联通卡都可以用。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span><img src=\"/mnt/data/img/attached/image/20170602/s6介绍01_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/s6介绍02_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/s6介绍03_3.jpg\" width=\"400\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span><img src=\"/mnt/data/img/attached/image/20170602/s6介绍04_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/s6介绍05_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/s6介绍06_3.jpg\" width=\"400\" alt=\"\" /><br />\r\n</span> \r\n</p>', '7天', '/attached/image/20170602/s6-1_3.jpg,/attached/image/20170602/s6-2_3.jpg,/attached/image/20170602/s6-3_3.jpg,/attached/image/20170602/s6-4_3.jpg,/attached/image/20170602/s6-5_3.jpg', '75', '23', '95', null, '鼎烨定制LM 6S', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000353', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('829', '特级调料礼盒', null, '428.00', null, '399.00', '/attached/image/20170602/特级调料礼盒003_3.jpg', '2017-06-02 15:50:42', '13237101494', '18824222366', '2017-06-03 20:33:38', 'n', 'n', '558', '2', '<ul class=\"attributes-list\" style=\"font-family:tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<li style=\"text-indent:5px;\">\r\n		<span style=\"font-family:tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;background-color:#FFFFFF;\">陈皮下饭豆豉x2 &nbsp;桔子醋 &nbsp; 桔子料酒 &nbsp;桔子蒸鱼汁 &nbsp;桔子味极鲜</span><span style=\"font-family:tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;background-color:#FFFFFF;\"></span><br />\r\n	</li>\r\n	<li style=\"text-indent:5px;\">\r\n		储藏方法:&nbsp;密闭、置于阴凉干燥处\r\n	</li>\r\n	<li style=\"text-indent:5px;\">\r\n		保质期:&nbsp;540天\r\n	</li>\r\n	<li style=\"text-indent:5px;\">\r\n		食品添加剂:&nbsp;无\r\n	</li>\r\n	<li style=\"text-indent:5px;\">\r\n		包装方式:&nbsp;包装\r\n	</li>\r\n	<li style=\"text-indent:5px;\">\r\n		<img src=\"/mnt/data/img/attached/image/20170602/桔子料酒_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/橘子醋_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170602/陈皮豆豉_3.jpg\" width=\"400\" alt=\"\" /><br />\r\n	</li>\r\n</ul>', '7天', '/attached/image/20170602/特级调料礼盒001_3.jpg,/attached/image/20170602/特级调料礼盒002_3.jpg,/attached/image/20170602/特级调料礼盒004_3.jpg', '82', '97', '3', null, '特级调料礼盒', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000355', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('830', '荟玫泉贵族明星护肤6件套', null, '4100.00', null, '4188.00', '/attached/image/20170601/tao五件套_3.jpg', '2017-06-02 16:41:55', '13237101494', '15827476130', '2017-06-03 17:11:57', 'n', 'n', '100', '2', '<p>\r\n	<span style=\"color:#000000;font-family:simhei;font-size:14px;line-height:27px;\">无香精 无色素 无酒精 无传统防腐剂 无矿物油 无PEG乳化剂 无激素</span><img src=\"/mnt/data/img/attached/image/20170601/jieshao介绍_3.jpg\" width=\"400\" alt=\"\" /> \r\n</p>', '15', '/attached/image/20170601/洗面奶_3.jpg,/attached/image/20170601/精华乳_3.jpg,/attached/image/20170601/精华液_3.jpg,/attached/image/20170601/赋活露_3.jpg,/attached/image/20170601/霜 荟玫泉_3.jpg,/attached/image/20170603/荟玫泉-面膜_3.jpg', '77', '4', '96', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000356', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('832', '艾奥比小太阳隔离防护喷雾', null, '870.00', null, '858.00', '/attached/image/20170605/小太阳001_3.jpg', '2017-06-05 17:22:06', '13237101494', '18824222366', '2017-06-06 21:44:06', 'n', 'n', '202', '2', '规格：100ml/瓶<br />\r\nLP艾奥比防晒防水喷雾 轻薄透气小太阳隔离防护喷雾<br />\r\n一款纯水清爽喷雾，100%植物成分提取，质地轻透不油腻。独特隔离成分，能在皮肤表层形成轻薄透气保护膜，防晒伤、美白、隔离、保湿补水一步到位，晒前补水、晒中保护、晒后修护。<br />\r\n防晒知识科普<br />\r\n★人体的皮肤比较细嫩，在阳光底下，会容易晒伤、晒黑，那么，小太阳隔离防护喷雾要喷几层？<br />\r\n一般情况是，喷一层就可以了。本产品为水雾状，轻轻的喷洒在皮肤全身，可以明显地感觉到冰凉感，料体瞬间被肌肤的吸收，带来清凉舒适感。<br />\r\n<p>\r\n	我与你只差一层防嗮喷雾，尽情享受大自然阳光的灿烂，有我你别怕！\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170605/小太阳006_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170605/138994829988482171_3.png\" width=\"400\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	检测报告\r\n</p>\r\n<p>\r\n	<img src=\"/mnt/data/img/attached/image/20170605/小太阳隔离防护喷雾检测报告-1_3.jpg\" width=\"400\" alt=\"\" /> \r\n</p>', '15', '/attached/image/20170605/小太阳002_3.jpg,/attached/image/20170605/小太阳003_3.jpg,/attached/image/20170605/小太阳004_3.jpg,/attached/image/20170605/小太阳005_3.jpg', '86', '28', '72', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000357', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('838', '途马车锦囊-汽车安全大礼包', null, '2390.00', null, '2328.00', '/attached/image/20170608/c车锦囊001_3.jpg', '2017-06-07 20:43:52', '13237101494', '18824222366', '2017-06-08 22:38:40', 'n', 'n', '127', '2', '<img src=\"/mnt/data/img/attached/image/20170608/c车锦囊008_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/c车锦囊009_3.jpg\" width=\"400\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/c车锦囊011_3.jpg\" width=\"400\" alt=\"\" />', '15', '/attached/image/20170608/c车锦囊002_3.jpg,/attached/image/20170608/c车锦囊003_3.jpg,/attached/image/20170608/c车锦囊004_3.jpg,/attached/image/20170608/c车锦囊005_3.jpg,/attached/image/20170608/c车锦囊006_3.jpg,/attached/image/20170608/c车锦囊007_3.jpg', '70', '5', '95', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000358', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('839', '鼎烨定制无叶电风扇', null, '1200.00', null, '1180.00', '/attached/image/20170608/无叶风扇001_3.jpg', '2017-06-08 09:24:08', '13237101494', '13237101494', '2017-06-08 12:44:29', 'n', 'n', '582', '2', '<p>\r\n	<span style=\"line-height:1.5;\">1、16寸（60x20cm）土豪金尊贵型，外观高端大气，风力强劲；</span>\r\n</p>\r\n<p>\r\n	2、智能遥控，预约定时；<br />\r\n3、轻柔安静睡眠，换风更健康；<br />\r\n4、节能省电，安全易清洗。<br />\r\n<img src=\"/attached/image/20170608/无叶风扇002_3_3.jpg\" alt=\"\" />\r\n</p>', '15', '/attached/image/20170608/无叶风扇002_3.jpg,/attached/image/20170608/无叶风扇003_3.jpg,/attached/image/20170608/无叶风扇004_3.jpg', '67', '112', '-12', null, null, null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000359', null, null, null, null, '31', null);
INSERT INTO `t_product_old` VALUES ('841', '鼎烨定制麻将席', null, '1600.00', null, '1580.00', '/attached/image/20170608/环保凉席001_3.jpg', '2017-06-08 14:35:19', '13237101494', '18824222366', '2017-06-09 16:18:55', 'n', 'n', '398', '2', '<p>\r\n	<span style=\"font-size:14px;\">规格：1.5x2.0m &nbsp; 1.8x2.0m &nbsp;（购买时请备注尺寸）</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">颜色：黄色 &nbsp;咖色</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">我们的产品籽片都是采用5-7年成年楠竹头层竹青，鱼线都是采用行业公认厦门产优质鱼线和牛筋线，使用寿命在3-7年之间，售后5年内出现质量问题免费发修复包，延续凉席的使用寿命。亲们可以放心购买！！</span><br />\r\n<span style=\"font-size:14px;\">因为宝贝生产批次不一样，可能会存在色差的哦，建议亲一次性购买，如果亲下次再来买的话，不保证颜色和这次发的一样哈，请亲多多理解哦！</span><br />\r\n<img src=\"/mnt/data/img/attached/image/20170608/环保凉席006_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/环保凉席007_3.jpg\" width=\"360\" alt=\"\" /><img src=\"/mnt/data/img/attached/image/20170608/环保凉席008_3.jpg\" width=\"360\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">注意事项：</span><br />\r\n<span style=\"font-size:14px;\">1. &nbsp;将收到的凉席用湿布擦拭后通风阴干，不可水洗，不可爆嗮.</span><br />\r\n<span style=\"font-size:14px;\">2. &nbsp;尺寸误差：麻将席是手工制品，成品会存在正负3cm的误差，请知悉！</span><br />\r\n<span style=\"font-size:14px;\">3. &nbsp;关于竹片破损： 由于麻将凉席为重货，在运输当中一旦不当，就会造成几个籽片有可能碎裂，因此我们发货前都会仔细检查好籽片，并叮嘱快递小心发货，所以籽片压坏的几率还是很小的。同时我们配送有修复包，换籽片也很简单，这种不属于质量问题，请知悉！</span><br />\r\n<br />\r\n<span style=\"font-size:14px;\">4. &nbsp;折叠式发货，您收到的席子有折痕难以避免，因此只需要将席子平铺使用几天，会自然平整。</span><br />\r\n<span style=\"font-size:14px;\">5. &nbsp;关于气味，竹制品肯定是有竹子的味道，一般情况下放几天味道就慢慢散了，每个人对气味的分别是不一样的，并不是质量问题。</span><br />\r\n<span style=\"font-size:14px;\"></span> \r\n</p>', '15', '/attached/image/20170608/环保凉席003_3.jpg,/attached/image/20170608/环保凉席004_3.jpg,/attached/image/20170608/环保凉席005_3.jpg', '70', '35', '65', null, '鼎烨定制麻将席', null, null, null, 'item', '0', 'n', null, null, '0', 'n', null, 'A000360', null, null, null, null, '31', null);
